(1, '0000-00-00', '', '2007-04-05', 'Administrateur', 'INT_CRE_XXX_AGE', '', 'INTERVENTION : Email envoyé vers une agence suite à saisie intervention', '<p>%logo_cge%<br />\r\n%cge_adr1%<br />\r\n%cge_adr2%<br />\r\n%cp_cge% %ville_cge%<br />\r\nTel : %cge_telf%<br />\r\nFax : %cge_fax%</p>\r\n<blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote>\r\n<p><strong>%age_nom%</strong><br />\r\n%age_adr1%<br />\r\n%age_adr2%<br />\r\n%cp_age% %ville_age%<br />\r\nTel : %age_telf%<br />\r\nFax : %age_fax%</p>\r\n</blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>\r\n<p>&nbsp;&nbsp;</p>\r\n<p><strong>A l''attention de %age_resp_civilite% %age_resp_prenom% %age_resp_nom%</strong></p>\r\n<p>%civiliter1M_age%,<br />\r\n<br />\r\nNous vous signalons la saisie d''une nouvelle demande d''intervention (N&deg;<strong> %int_code%</strong>, client %cli_code%).<br />\r\n<br />\r\nMerci de prendre rapidement contact avec le client demandeur pour la mise en place de l''intervention.<br />\r\n<br />\r\nBonne fin de journ&eacute;e.  <br />\r\n<br />\r\nLe centre de gestion</p>', 0),
(2, '0000-00-00', '', '2007-04-05', 'Administrateur', 'INT_CLOT_XXX_CLI', '', 'INTERVENTION : Email envoyé vers un client si intervention close', '<p>%logo_age%<br />\r\n<strong>%age_adr1%<br />\r\n%age_adr2%<br />\r\n%cp_age% %ville_age%<br />\r\nTel : %age_telf%<br />\r\nFax : %age_fax%</strong></p>\r\n<p>&nbsp;</p>\r\n<p><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><strong>%cli_ste%</strong><br />\r\n<strong> %cli_civilite% %cli_prenom% %cli_nom%</strong><br />\r\n%cli_adr1%<br />\r\n%cli_adr2%<br />\r\n%cp_cli% %ville_cli% <br />\r\nTel : %cli_telf%<br />\r\nFax : %cli_fax%</blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>  <br />\r\n%civilite1M_cli%,</p>\r\n<p>C''est avec plaisir que nous vous annon&ccedil;ons que votre dossier d''intervention (N&deg; <strong>%int_code%</strong>) est clot.  <br />\r\n<br />\r\nVous pouvez en obtenir le d&eacute;tail sur notre site :  <a href="http://%cge_web%">%cge_web%</a>  .<br />\r\n<br />\r\nNous vous souhaitons une excellente fin de journ&eacute;e et vous prions d''agr&eacute;er, %civilite1M_cli%,&nbsp; l''expression de nos sentiments les plus d&eacute;vou&eacute;s.  <br />\r\n<br />\r\nLe service technique</p>', 0),
(3, '0000-00-00', '', '2006-07-12', 'Administrateur', 'INT_FAITF_XXX_CDG', '', 'INTERVENTION : Email envoyé vers le CDG (pour facturation) si intervention traitée', 'Bonjour,<br /><br />L''intervention N&deg; <strong>%int_code%</strong> a &eacute;t&eacute; trait&eacute;e par l''agence <strong>%int_codeage%</strong>.<br /><br />Merci d''&eacute;tablir la facture et l''exp&eacute;dier au client.<br /><br />Bonne fin de journ&eacute;e.', 0),
(4, '0000-00-00', '', '2006-07-12', 'Administrateur', 'MAIL_PIED', '', 'Pied de chaque email', '---<font size="1"><em><br /></em><em>Cet email est transmis &agrave; titre priv&eacute;. Si vous n''&ecirc;tes pas le destinataire de ce message, merci de le retourner &agrave; l''exp&eacute;diteur et de le d&eacute;truire. </em></font>', 0),
(7, '0000-00-00', '', '2006-07-12', 'Administrateur', 'INT_CRE_XXX_CDG', '', 'INTERVENTION : Email envoyé vers le CDG suite à demande saisie par une agence', 'Bonjour,<br /><br />Nous vous signalons la saisie d''''une nouvelle demande d''intervention (N&deg;<strong> %int_code%</strong>) par l''agence <strong>%int_codeage%</strong>.<br /><br />Bonne fin de journ&eacute;e.', 0),
(10, '0000-00-00', '', '2007-04-05', 'Administrateur', 'CLI_CRE_XXX_CLI', '', 'CLIENT : Email envoyé vers le client suite à création de son compte', '%logo_cge%<br />\r\n<strong>%cge_adr1%<br />\r\n%cge_adr2%<br />\r\n%cp_cge% %ville_cge%<br />\r\nTel : %cge_telf%<br />\r\nFax : %cge_fax%</strong><br /><br />\r\n<blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><strong>%cli_ste%</strong><br />\r\n<strong> %cli_civilite% %cli_prenom% %cli_nom%</strong><br />\r\n<strong> %cli_adr1%</strong><br />\r\n<strong> %cli_adr2%</strong><br />\r\n<strong> %cp_cli% %ville_cli% </strong><br />\r\n<strong> Tel : %cli_telf%</strong><br />\r\n<strong> Fax : %cli_fax%</strong></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>\r\n<p><br />\r\n%civilite1M_cli%,  <br />\r\n<br />\r\nC''est avec plaisir que nous vous confirmons la cr&eacute;ation de votre compte.  <br />\r\n<br />\r\nVoici vos codes de connexion et mot de passe :</p>\r\n<blockquote>Code de connexion : <strong>%cli_code%</strong> <br />\r\nMot de passe          : <strong>%pass%</strong>  </blockquote>\r\n<p><br />\r\nConservez pr&eacute;cieusement ces informations pour pouvoir vous connecter et suivre vos dossiers d''interventions et contrats sur notre site <a href="http://%cge_web%">%cge_web%</a> (menu &quot;Espace priv&eacute;&quot;).<br />\r\n<br />\r\nNous vous remercions encore de votre confiance.  <br />\r\n<br />\r\nLe centre de gestion</p>', 0),
(12, '0000-00-00', '', '2007-04-02', 'Administrateur', 'TEC_CRE_XXX_TEC', '', 'TECHNICIEN : Email envoyé vers le technicien suite à création de son compte', '<p>%logo_cge%<br />\r\n%cge_adr1%<br />\r\n%cge_adr2%<br />\r\n%cp_cge% %ville_cge%<br />\r\nTel : %cge_telf%<br />\r\nFax : %cge_fax%</p>\r\n<p>&nbsp;</p>\r\n<blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote>\r\n<p><strong>%tec_civilite% %tec_prenom% %tec_nom%</strong><br />\r\n%tec_adr1%<br />\r\n%tec_adr2%<br />\r\n%cp_tec% %ville_tec%<br />\r\nTel : %tec_telf%</p>\r\n</blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>\r\n<p>%civilite1M_tec%,<br />\r\n<br />\r\nC''est avec plaisir que nous vous confirmons la cr&eacute;ation de votre compte.  <br />\r\n<br />\r\nVoici vos codes et mot de passe :</p>\r\n<blockquote>Code de connexion : <strong>%tec_code%</strong><br />\r\n<br />\r\nMot de passe          : <strong>%pass%</strong></blockquote>\r\n<p><br />\r\nConservez pr&eacute;cieusement ces informations pour pouvoir vous connecter et suivre vos dossiers techniques sur notre site <a href="http://%cge_web%">%cge_web%</a> (menu &quot;Espace priv&eacute;&quot;).  <br />\r\n<br />\r\nBonne fin de journ&eacute;e.  <br />\r\n<br />\r\nLe Webmaster.</p>', 0),
(13, '0000-00-00', '', '2007-04-02', 'Administrateur', 'TEC_CRE_XXX_CDG', '', 'TECHNICIEN : Email envoyé vers le CDG suite à création par une agence', '<p>Bonjour,<br />\r\n<br />\r\nNous vous signalons la cr&eacute;ation d''un nouveau compte technicien (N&deg; <strong>%tec_code%</strong>, <strong>%tec_civilite% %tec_prenom% %tec_nom%</strong>) au sein de l''agence <strong>%tec_codeage%</strong>.  <br />\r\n<br />\r\nBonne fin de journ&eacute;e.</p>', 0),
(16, '0000-00-00', '', '2008-05-06', 'Administrateur', 'AGE_CRE_XXX_AGE', '', 'AGENCE : Email envoyé vers l''agence suite à création de son compte', '<p>%logo_cge%<br />\r\n%cge_adr1%<br />\r\n%cge_adr2%<br />\r\n%cp_cge% %ville_cge%<br />\r\nTel : %cge_telf%<br />\r\nFax : %cge_fax%</p>\r\n<blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote>\r\n<p><strong>%age_nom%</strong><br />\r\n%age_adr1%<br />\r\n%age_adr2%<br />\r\n%cp_age% %ville_age%<br />\r\nTel : %age_telf%<br />\r\nFax : %age_fax%</p>\r\n</blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>A l''attention de %age_resp_civilite% %age_resp_prenom% %age_resp_nom%</strong></p>\r\n<p>%civiliter1M_age%,<br />\r\n<br />\r\nC''est avec plaisir que nous vous confirmons la cr&eacute;ation de votre compte.  <br />\r\n<br />\r\nVoici vos codes de connexion et mot de passe :</p>\r\n<blockquote>Code de connexion : <strong>%age_code%</strong> <br />\r\nMot de passe          : <strong>%pass%</strong></blockquote>\r\n<p>Conservez pr&eacute;cieusement ces informations pour pouvoir vous connecter et suivre vos dossiers techniques sur notre site <a href="http://%cge_web%">%cge_web%</a> (menu &quot;Espace priv&eacute;&quot;).<br />\r\n<br />\r\nBonne fin de journ&eacute;e.  <br />\r\n<br />\r\nLe centre de gestion</p>', 0),
