(21, '0000-00-00', '', '2007-04-05', 'Administrateur', 'OPE_CRE_XXX_OPE', '', 'OPERATEUR : Email envoyé vers l''opérateur suite à création de son compte', '<p>%logo_cge%<br />\r\n%cge_adr1%<br />\r\n%cge_adr2%<br />\r\n%cp_cge% %ville_cge%<br />\r\nTel : %cge_telf%<br />\r\nFax : %cge_fax%</p>\r\n<p>&nbsp;</p>\r\n<p><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote>\r\n<p><strong>%ope_civilite% %ope_prenom% %ope_nom%</strong><br />\r\n%ope_adr1%<br />\r\n%ope_adr2%<br />\r\n%cp_ope% %ville_ope%<br />\r\nTel : %ope_telf%</p>\r\n</blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote> %civilite1M_ope%,</p>\r\n<p>C''est avec plaisir que nous vous confirmons la cr&eacute;ation de votre compte.<br />\r\n<br />\r\nVoici vos codes et mot de passe :  </p>\r\n<blockquote>Code de connexion : <strong>%ope_code%</strong><br />\r\nMot de passe          : <strong>%pass%</strong></blockquote>\r\n<p><br />\r\nConservez pr&eacute;cieusement ces informations pour pouvoir vous connecter et suivre vos dossiers sur notre site <a href="http://%cge_web%">%cge_web%</a> (menu &quot;Connectez-vous &agrave; votre espace priv&eacute;&quot;.  <br />\r\n<br />\r\nBonne fin de journ&eacute;e.  <br />\r\n<br />\r\nLe centre de gestion</p>', 0),
(22, '2005-10-16', 'Administrateur', '2006-07-12', 'Administrateur', 'INT_FAITI_XXX_CDG', '', 'INTERVENTION : Email envoyé vers le CDG (pour info) si intervention traitée', 'Bonjour,<br /><br />L''intervention N&deg; <strong>%int_code%</strong> a &eacute;t&eacute; trait&eacute;e par l''agence <strong>%int_codeage%</strong>.  <br /><br />La facture sera &eacute;tablie par l''agence.  <br /><br />Bonne fin de journ&eacute;e.', 0),
(24, '2005-10-16', 'Administrateur', '2007-04-05', 'Administrateur', 'AGE_MDP_XXX_AGE', '', 'AGENCE : Email envoyé vers l''agence suite à changement de MDP', '%logo_cge%<br />\r\n%cge_adr1%<br />\r\n%cge_adr2%<br />\r\n%cp_cge% %ville_cge%<br />\r\nTel : %cge_telf%<br />\r\nFax : %cge_fax%<br /><br />\r\n<blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote>\r\n<p><strong>%age_nom%</strong><br />\r\n%age_adr1%<br />\r\n%age_adr2%<br />\r\n%cp_age% %ville_age%<br />\r\nTel : %age_telf%<br />\r\nFax : %age_fax%</p>\r\n</blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>A l''attention de %age_resp_civilite% %age_resp_prenom% %age_resp_nom%</strong></p>\r\n<p>%civiliter1M_age%,<br />\r\n<br />\r\nC''est avec plaisir que nous vous confirmons la mise &agrave;  jour de votre compte.  Voici vos codes de connexion et mot de passe :</p>\r\n<blockquote>Code de connexion : <strong>%age_code%</strong><br />\r\nMot de passe          : <strong>%pass%</strong></blockquote>\r\n<p><br />\r\nConservez pr&eacute;cieusement ces informations pour pouvoir vous connecter et suivre vos dossiers techniques sur notre site <a href="http://%cge_web%">%cge_web%</a> (menu &quot;Espace priv&eacute;&quot;).<br />\r\n<br />\r\nBonne fin de journ&eacute;e.  <br />\r\n<br />\r\nLe centre de gestion</p>', 0),
(25, '2005-10-16', 'Administrateur', '2007-04-05', 'Administrateur', 'CDG_MDP_XXX_CDG', '', 'CENTRE DE GESTION : Email envoyé vers le CDG suite à changement de MDP par le CDG', '<p>Bonjour,<br />\r\n<br />\r\nC''est avec plaisir que nous vous confirmons la mise &agrave; jour de votre compte.<br />\r\n<br />\r\nVoici vos codes de connexion et mot de passe :  </p>\r\n<blockquote>Code de connexion : <strong>%cge_code%</strong><br />\r\nMot de passe          : <strong>%pass%</strong></blockquote>\r\n<p><br />\r\nConservez pr&eacute;cieusement ces informations pour pouvoir vous connecter et suivre vos dossiers techniques et commerciaux sur notre site <a href="http://%cge_web%">%cge_web%</a> (menu &quot;Connectez-vous &agrave; votre espace priv&eacute;&quot;).<br />\r\n<br />\r\nBonne fin de journ&eacute;e.<br />\r\n<br />\r\nLe centre de gestion</p>', 0),
