(35, '2005-10-16', 'Administrateur', '2007-08-11', 'Administrateur', 'CON_CRE_XXX_CLI', '', 'CONTRAT : Email envoyé vers un client suite à création', '<p>%logo_cge%<br />\r\n<strong>%cge_adr1%<br />\r\n%cge_adr2%<br />\r\n%cp_cge% %ville_cge%<br />\r\nTel : %cge_telf%<br />\r\nFax : %cge_fax%</strong></p>\r\n<p>&nbsp;</p>\r\n<blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><strong>%cli_ste%</strong><br />\r\n<strong> %cli_civilite% %cli_prenom% %cli_nom%</strong><br />\r\n<strong> %cli_adr1%</strong><br />\r\n<strong> %cli_adr2%</strong><br />\r\n<strong> %cp_cli% %ville_cli% </strong><br />\r\n<strong> Tel : %cli_telf%</strong><br />\r\n<strong> Fax : %cli_fax%</strong></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>\r\n<p><br />\r\n%civilite1M_cli%,  <br />\r\n<br />\r\nC''est avec plaisir que nous vous annon&ccedil;ons la mise en place de votre contrat (N&deg; <strong>%cocl_code%</strong>).  <br />\r\n<br />\r\nMerci de le t&eacute;l&eacute;charger, d''en contr&ocirc;ler l''exactitude (si ce n''&eacute;tait pas le cas, merci de nous le signaler), puis de l''imprimer, depuis votre espace client, sur notre site <a href="http://%cge_web%">%cge_web%</a> (menu &quot;Espace priv&eacute;&quot;) .<br />\r\n<br />\r\nEnsuite, merci de nous le retourner, en deux exemplaires originaux, paraph&eacute;s, tamponn&eacute;s, et sign&eacute;s, &agrave; l''adresse suivante :</p>\r\n<blockquote><strong>%cge_nom%</strong><strong><br />\r\nService Contrats Clients</strong> <br />\r\n%cge_adr1% <br />\r\n%cge_adr2% <br />\r\n%cp_cge% %ville_cge% .</blockquote>\r\n<p><br />\r\nNous vous souhaitons une excellente fin de journ&eacute;e et vous prions d''agr&eacute;er, %civilite1M_cli%,&nbsp; l''expression de nos sentiments les plus d&eacute;vou&eacute;s.<br />\r\n<br />\r\nLe centre de gestion</p>', 0),
