(41, '2005-10-16', 'Administrateur', '2007-04-05', 'Administrateur', 'CON_CRE_XXX_AGE', '', 'CONTRAT : Email envoyé vers l''agence suite à un nouveau contrat', '%logo_cge%<br />\r\n%cge_adr1%<br />\r\n%cge_adr2%<br />\r\n%cp_cge% %ville_cge%<br />\r\nTel : %cge_telf%<br />\r\nFax : %cge_fax%<br /><br />\r\n<blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote>\r\n<p><strong>%age_nom%</strong><br />\r\n%age_adr1%<br />\r\n%age_adr2%<br />\r\n%cp_age% %ville_age%<br />\r\nTel : %age_telf%<br />\r\nFax : %age_fax%</p>\r\n</blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>\r\n<p>&nbsp;&nbsp;</p>\r\n<p><strong>A l''attention de %age_resp_civilite% %age_resp_prenom% %age_resp_nom%</strong></p>\r\n<p>%civiliter1M_age%,<br />\r\n<br />\r\nNous vous signalons la saisie d''un nouveau contrat (N&deg; <strong>%cocl_code%</strong>, client %cli_code%).<br />\r\n<br />\r\nS''il s''agit d''un contrat &agrave; interventions programm&eacute;es, vous voudrez bien prendre contact avec le client afin de poser des dates de rendez-vous.<br />\r\n<br />\r\nBonne fin de journ&eacute;e.</p>\r\n<p>Le centre de gestion.</p>', 0),
(45, '2005-10-19', 'Administrateur', '2006-08-21', 'Administrateur', 'CGV_MASTER', 'CONDITIONS GENERALES DE VENTE %cge_nom%', 'Texte master des conditions générales de vente globales', 'Les pr&eacute;sentes conditions g&eacute;n&eacute;rales de vente sont port&eacute;es &agrave; la connaissance du client par lien hypertexte sur la page d&rsquo;accueil du site %cge_nom%, en compl&eacute;ment des bons d&rsquo;intervention ou de commandes fournis au client par %cge_nom%, et dans les agences %cge_nom%.  <br /><br />En cons&eacute;quence, le fait de passer commande implique l&rsquo;adh&eacute;sion enti&egrave;re et sans r&eacute;serve du client &agrave; ces conditions g&eacute;n&eacute;rales de vente.<br /><br /><font size="5"><u><strong>I - Objet</strong></u></font><br /><br />%cge_nom% est une soci&eacute;t&eacute; de conseil, revente de mat&eacute;riel, maintenance, assistance, d&eacute;pannage et prestations de services informatiques.<br /><br />%cge_nom% commercialise &eacute;galement les pi&egrave;ces d&eacute;tach&eacute;es et mat&eacute;riels n&eacute;cessaires &agrave; l''ex&eacute;cution de sa mission.   <strong><br /><br /><font size="5"><u>II - Caract&eacute;ristiques des biens et services propos&eacute;s</u></font></strong><u><br /><br /><em>Nature et &eacute;tendue</em></u><em>  </em><br />%cge_nom% intervient sur demande expresse du client.  <br />La prestation de services de %cge_nom% est destin&eacute;e au maintien et/ou &agrave; la remise en &eacute;tat de fonctionnement de mat&eacute;riels informatiques, notamment suite &agrave; des types d''''incidents li&eacute;s &agrave; la manipulation de l''''ordinateur, &agrave; l''initialisation, &agrave; la mise en route, ou plus g&eacute;n&eacute;ralement au fonctionnement de l''ordinateur.  <br />Le client fournira les outils logiciels licenci&eacute;s ainsi que tous les documents du constructeur n&eacute;cessaires &agrave; l''''intervention.  <u><br /><br /><em>Limites</em></u><br />La prestation est d&ucirc;e par le client, inclus si la panne est due &agrave; un environnement physique non conforme aux sp&eacute;cifications du constructeur ou aux r&egrave;gles de s&eacute;curit&eacute;, &agrave; une utilisation anormale (volontaire ou non), &agrave; un &eacute;v&eacute;nement accidentel (incendie, inondation, foudre...), &agrave; un cas de force majeur (gr&egrave;ve, &eacute;meute) et/ou &agrave; une cause exon&eacute;ratoire (impossibilit&eacute; d''''acc&egrave;s &agrave; un local, conditions d&eacute;fectueuses d''''alimentation &eacute;lectrique...).<br />De m&ecirc;me la prestation est d&ucirc;e par le client si elle porte sur un mat&eacute;riel modifi&eacute;, sans que %cge_nom% en ait &eacute;t&eacute; pr&eacute;alablement avis&eacute;, sur un logiciel, si elle est engendr&eacute;e par une nouvelle version de logiciel ou si elle r&eacute;sulte du non respect des obligations du contrat (conditions d''''acc&egrave;s, sauvegarde des donn&eacute;es, paiement...).<br />Les d&eacute;lais d''''intervention sont donn&eacute;s &agrave; titre indicatif. Ils sont bas&eacute;s sur un d&eacute;lai moyen pr&eacute;visionnel. Le d&eacute;passement de ces d&eacute;lais ne peut donner lieu &agrave; aucunes retenues, indemnit&eacute;s ou p&eacute;nalit&eacute;s au b&eacute;n&eacute;fice du client.  Les d&eacute;lais indiqu&eacute;s sont en outre de plein droit suspendus par tout &eacute;v&eacute;nement ind&eacute;pendant de la volont&eacute; de la soci&eacute;t&eacute; et ayant pour cons&eacute;quence de retarder l''intervention.<br />En toute hypoth&egrave;se, l''intervention dans les d&eacute;lais ne peut intervenir que si le client est imp&eacute;rativement &agrave; jour de toutes ses obligations &agrave; l''&eacute;gard de %cge_nom%.   <u><br /><br /><em>Commandes de mat&eacute;riel</em></u><br />Du fait des lois et r&eacute;glementations, d''''erreur manifeste, de l''&eacute;volution rapide des produits informatiques ou des ruptures de stock, %cge_nom% peut apporter des modifications &agrave; une commande, sous r&eacute;serve que les produits de remplacement soient, si possible, de technologie et de prix sensiblement &eacute;quivalents, et en ayant pr&eacute;alablement pr&eacute;venu le client.<br />Toute commande accept&eacute;e ne peut &ecirc;tre r&eacute;solue que par accord express des deux parties, par d&eacute;cision de justice, par %cge_nom% seule dans le cas de factures rest&eacute;es impay&eacute;es malgr&eacute; une mise en demeure, ou dans le cas de reprise de mat&eacute;riel au titre de la r&eacute;serve de propri&eacute;t&eacute;.<br />Dans l''''hypoth&egrave;se o&ugrave; %cge_nom% accepterait une annulation de commande, acceptation qui devra se faire par &eacute;crit de %cge_nom%, le client paiera une indemnit&eacute; de 15% du montant de la commande annul&eacute;e.<br /><br /><em><u>Livraison de mat&eacute;riel</u></em><br />Le mat&eacute;riel, m&ecirc;me exp&eacute;di&eacute; franco, voyage aux risques et p&eacute;rils du client auquel il appartient de v&eacute;rifier l&rsquo;&eacute;tat des colis et de la marchandise &agrave; l&rsquo;arriv&eacute;e et d&rsquo;exercer, s&rsquo;il y a lieu, tous recours contre le transporteur. <br />Les marchandises ne sont assur&eacute;es que sur demande expresse du client.  Les r&eacute;clamations sur le vice apparent ou sur la non-conformit&eacute; du produit livr&eacute; au produit command&eacute; doivent &ecirc;tre formul&eacute;es par &eacute;crit dans les sept jours de la r&eacute;ception des produits.  Il appartient au client de fournir toutes justifications quant &agrave; la r&eacute;alit&eacute; des vices ou anomalies constat&eacute;s. <br />Il devra laisser &agrave; %cge_nom% toute facilit&eacute; pour proc&eacute;der &agrave; la constatation de ce vice et pour y porter rem&egrave;de.  Il s''abstiendra d''intervenir lui-m&ecirc;me ou de faire intervenir un tiers &agrave; cette fin.   <strong><br /><br /><font size="5"><u>III - Garantie</u></font></strong><br /><br />La seule garantie accord&eacute;e par %cge_nom% est celle attribu&eacute;e par chaque constructeur sur ses produits.  <br />Les produits devront &ecirc;tre retourn&eacute;s en port pay&eacute; par le client chez %cge_nom% ou bien au Service Apr&egrave;s Vente des soci&eacute;t&eacute;s assurant directement la garantie des produits concern&eacute;s.<br />L''utilisation des articles fournis se fait sous la responsabilit&eacute; exclusive du client &agrave; qui il appartient d''''assumer la direction et la surveillance des articles.  <br />Sont exclus de la garantie tous dommages r&eacute;sultant notamment d''''une mauvaise utilisation, d''une utilisation abusive des articles ou n&eacute;gligence du client, de la foudre, du non-respect des instructions d''installation ou d''exploitation, d''une intervention effectu&eacute;e sur les articles par un tiers non agr&eacute;&eacute; express&eacute;ment par le constructeur ou %cge_nom%, ainsi que tous dommages r&eacute;sultant de l''emploi de fournitures non agr&eacute;&eacute;es, de la force majeure ou du fait de tiers.<br />Toute r&eacute;clamation selon laquelle les articles seraient d&eacute;fectueux quant &agrave; leur mati&egrave;re ou &agrave; leur fabrication devra &ecirc;tre faite par &eacute;crit sans d&eacute;lai &agrave; %cge_nom% par le client et inclure toutes explications n&eacute;cessaires.  <br />Le client d&eacute;gage %cge_nom% de toute responsabilit&eacute; en cas de perte ou dommage r&eacute;sultant de l''emploi des donn&eacute;es, r&eacute;sultats, programmes ou de documents mis &agrave; sa disposition.  <br />A l''''&eacute;gard des tiers, le client fera son affaire personnelle de toute r&eacute;clamation.  Les accessoires et consommables ne sont pas couverts par une garantie, sauf d&eacute;faut manifeste de fabrication.   <strong><br /><br /><font size="5"><u>IV - R&eacute;serve de propri&eacute;t&eacute;</u></font></strong><u><br /><em><br />Mat&eacute;riel</em></u><em>  </em><br />Aux termes de la loi du 3 juillet 1985, %cge_nom% reste propri&eacute;taire des mat&eacute;riels d&eacute;sign&eacute;s par la facture jusqu''au complet paiement du prix de vente par le client, et ce pour toutes les ventes pr&eacute;sentes et futures.  A d&eacute;faut de paiement total ou partiel, %cge_nom% est en droit, sans formalit&eacute;s pr&eacute;alables et ind&eacute;pendamment de toute action judiciaire, d''exiger du client sans que celui-ci puisse s''y opposer, et &agrave; ses frais, la restitution du mat&eacute;riel. <br /><br /><em><u>Logiciel</u></em><br />Le client reconna&icirc;t sur les logiciels conc&eacute;d&eacute;s l''enti&egrave;re propri&eacute;t&eacute; des &eacute;diteurs, et se devra de respecter la l&eacute;gislation en vigueur et les conditions de licence des &eacute;diteurs.  Il lui est formellement interdit d''''en faire une quelconque copie, sauf &agrave; titre exclusif de sauvegarde.  Le client respectera et s''engage &agrave; faire respecter les droits d''auteur reconnus par le Code de la Propri&eacute;t&eacute; Intellectuelle.     <strong><br /><br /><font size="5"><u>V - Obligations</u></font></strong><font size="5"><u>  </u></font><br /><br />%cge_nom% s''engage &agrave; fournir la main d''&oelig;uvre et les pi&egrave;ces d&eacute;tach&eacute;es n&eacute;cessaires &agrave; l''accomplissement des prestations d&eacute;finies dans l''objet.  %cge_nom% a la facult&eacute; de sous-traiter tout ou partie de l''''ex&eacute;cution des travaux de maintenance ou commandes pass&eacute;es par le client.<br /><br /><font size="5"><u><strong>VI - Obligations du client</strong></u></font><br /><br />Le client s''engage &agrave; &eacute;tablir et entretenir un environnement physique du mat&eacute;riel conforme aux sp&eacute;cifications du constructeur et aux normes de s&eacute;curit&eacute;, &agrave; respecter les proc&eacute;dures d''''utilisation des mat&eacute;riels (accessoires, consommables...) et en particulier ne proc&eacute;der &agrave; aucune modification technique ou g&eacute;ographique, &agrave; fournir les consommables et accessoires n&eacute;cessaires aux intervenants de maintenance, &agrave; &ecirc;tre pr&eacute;sent lors de l''intervention pendant toute sa dur&eacute;e et constater la fin de celle-ci, sauvegarder les informations contenues dans le mat&eacute;riel (donn&eacute;es, programme, fichier...) pr&eacute;alablement &agrave; toute intervention, &agrave; tenir &agrave; disposition la documentation technique remise par le constructeur et, en cas de panne, tenter de reconstituer l''historique de l''apparition et du constat de celle-ci.  <br /><strong><br /><font size="5"><u>VII - Exon&eacute;ration de responsabilit&eacute;s</u></font></strong><br /><br />Le client est inform&eacute; que l''intervention de %cge_nom%, comme sa propre intervention entra&icirc;ne la perte garantie constructeur &agrave; laquelle ne se substitue pas une garantie de %cge_nom%.<br />Le client reconna&icirc;t express&eacute;ment et sans contestation possible l''exon&eacute;ration totale de %cge_nom% de ce fait.<br />De convention expresse entre les parties, %cge_nom% n''''est soumise, au titre des pr&eacute;sentes, qu''&agrave; une obligation de moyens, et non pas de r&eacute;sultat.  En aucun cas, %cge_nom%, ne peut &ecirc;tre tenu pour responsable des dommages directs et indirects et/ou mat&eacute;riel et immat&eacute;riels de dommages li&eacute;s &agrave; un retard de livraison, de dommages li&eacute;s &agrave; une non-conformit&eacute; aux besoins du client ou de dommages dus &agrave; une cause ind&eacute;pendante de l''intervention de %cge_nom%.<br />%cge_nom% a souscrit une police d''''assurance de responsabilit&eacute; civile couvrant les cons&eacute;quences p&eacute;cuniaires pouvant lui incomber en raison des dommages corporels et mat&eacute;riels caus&eacute;s au client, ou &agrave; des tiers, par son personnel au cours de l''''ex&eacute;cution de son intervention.  La responsabilit&eacute; de %cge_nom% ne porte que sur le non respect de ses obligations.<br />En aucun cas %cge_nom% ne  pourra &ecirc;tre tenu responsable d''un pr&eacute;judice financier ou commercial, ou m&ecirc;me d''une autre  nature caus&eacute; directement ou indirectement par l''''utilisation ou le fonctionnement du mat&eacute;riel.<strong><br /><br /><font size="5"><u>VIII - Conditions financi&egrave;res</u></font></strong><br /><br />Les tarifs des interventions sont stipul&eacute;es en H.T. pour les soci&eacute;t&eacute;s et en T.T.C. pour les particuliers, sans aucun escompte. Ils sont ceux en vigueur au moment de la prise de commande.  Une &eacute;ventuelle remise peut toujours &ecirc;tre modifi&eacute;e ou annul&eacute;e pour toute nouvelle commande, et uniquement par &eacute;crit de %cge_nom%.  <br /><br /><em><u>Modalit&eacute;s de facturation et de r&egrave;glement</u></em><br />Les d&eacute;lais et modalit&eacute;s de paiement sont fix&eacute;s unilat&eacute;ralement par %cge_nom% comme suit pour les particuliers et professions lib&eacute;rales, le jour m&ecirc;me &agrave; l''issue de la mission et directement &agrave; l''intervenant par ch&egrave;que.  <br />Un acompte peut &ecirc;tre demand&eacute; au client lors du d&eacute;p&ocirc;t ou de l''enl&egrave;vement de son mat&eacute;riel.  <br />Tout retard de paiement entra&icirc;ne des frais financiers au taux de base bancaire +5%, l''application d''une clause p&eacute;nale &eacute;gale &agrave; 10% du montant hors taxe de la facture, et l''exigibilit&eacute; imm&eacute;diate de toutes les factures non encore &eacute;chues.  <br />De plus tout incident bancaire entra&icirc;ne le paiement par le client des frais bancaires support&eacute;s par %cge_nom% plus 2% du montant de l''impay&eacute; correspondant aux frais de gestion.  <br />Toute inex&eacute;cution totale ou partielle de l''une de ces obligations entra&icirc;ne l''exigibilit&eacute; imm&eacute;diate de toutes les sommes encore dues &agrave; quelque titre que ce soit, l''annulation des &eacute;ventuelles remises accord&eacute;es ainsi que la suspension de toute livraison.  <br />Le r&egrave;glement est fait en globalit&eacute;, d&egrave;s ach&egrave;vement de l''intervention, sauf accord pr&eacute;alable par &eacute;crit de %cge_nom%, par ch&egrave;que ou esp&egrave;ces directement aux techniciens sur place, ou tout moyen de paiement l&eacute;gal si en agence %cge_nom%.  <br />Une facture est ensuite envoy&eacute;e par courrier au client.  <br />Toute intervention donne lieu &agrave; une facturation minimale d''une heure.  Tout rendez-vous non annul&eacute; par &eacute;crit 48 heures avant l''intervention donne lieu &agrave; la facturation minimale.   <br /><br /><font size="5"><u><strong>X - Propri&eacute;t&eacute; intellectuelle</strong></u></font><br /><br />Tous les &eacute;l&eacute;ments de %cge_nom% sont et restent la propri&eacute;t&eacute; intellectuelle et exclusive de %cge_nom%.  Personne n''est autoris&eacute; &agrave; reproduire, exploiter, rediffuser, ou utiliser &agrave; quelque titre que ce soit, m&ecirc;me partiellement, des &eacute;l&eacute;ments du site qu''ils soient logiciels, visuels ou sonores.<br />Tout lien simple ou par hypertexte est strictement interdit sans un accord &eacute;crit de %cge_nom%.  <br /><br /><font size="5"><u><strong>XI - Attribution de comp&eacute;tence</strong></u></font><br /><br />Les pr&eacute;sentes conditions sont r&eacute;gies par le droit fran&ccedil;ais. En cas d''&eacute;chec d''une proc&eacute;dure de conciliation amiable, tout litige d&eacute;coulant des pr&eacute;sentes conditions est de la comp&eacute;tence exclusive du Tribunal de Commerce de %cge_tcom%, nonobstant la pluralit&eacute; de d&eacute;fenseurs ou appel en garantie.  <br /><br /><font size="5"><u><strong>XII- Loi informatique et libert&eacute;</strong></u></font><br /><br />Conform&eacute;ment &agrave; la loi informatique et libert&eacute; du 6 janvier 1978, le client dispose d''''un droit d''acc&egrave;s et de rectification aux donn&eacute;es le concernant.  Ces donn&eacute;es ont pu &ecirc;tre communiqu&eacute;es &agrave; des entreprises tiers et le client peut donc &ecirc;tre amen&eacute; &agrave; recevoir de ces soci&eacute;t&eacute;s des propositions commerciales.  <br />S''il ne le souhaite pas, il lui suffit d''&eacute;crire &agrave; %cge_nom% en indiquant ses nom, pr&eacute;noms, adresse, adresse e-mail afin que %cge_nom% puisse faire le n&eacute;cessaire dans les meilleurs d&eacute;lais ou de s''''inscrire sur la liste &quot;Robison Stop-publicit&eacute;&quot; en &eacute;crivant &agrave; l''''UFMD, 60 rue de la Bo&eacute;tie, 75008 Paris.', 0),
(46, '2005-10-21', 'Administrateur', '2007-04-05', 'Administrateur', 'CON_AR_XXX_CLI', '', 'CONTRAT : Email envoyé vers un client pour accuser réception', '%logo_cge%<strong><br />\r\n%cge_adr1%<br />\r\n%cge_adr2%<br />\r\n%cp_cge% %ville_cge%</strong><br />\r\nTel : %cge_telf%<br />\r\nFax : %cge_fax%<br /><br />\r\n<blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><strong>%cli_ste%</strong><br />\r\n<strong> %cli_civilite% %cli_prenom% %cli_nom%</strong><br />\r\n<strong> %cli_adr1%</strong><br />\r\n<strong> %cli_adr2%</strong><br />\r\n<strong> %cp_cli% %ville_cli% </strong><br />\r\n<strong> Tel : %cli_telf%</strong><br />\r\n<strong> Fax : %cli_fax%</strong></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>\r\n<p><br />\r\n%civilite1M_cli%,<br />\r\n<br />\r\nC''est avec plaisir que nous accusons r&eacute;ception de votre contrat sign&eacute; (N&deg; <strong>%cocl_code%</strong>).<br />\r\n<br />\r\nIl est activ&eacute; d&egrave;s aujourd''hui.  <br />\r\n<br />\r\nVous pouvez le suivre en temps r&eacute;el sur notre site :  <a href="http://%cge_web%">%cge_web%</a>   .<br />\r\n<br />\r\nNous vous souhaitons une excellente fin de journ&eacute;e et vous prions d''agr&eacute;er,&nbsp; %civilite1M_cli%, l''expression de nos sentiments les plus d&eacute;vou&eacute;s.<br />\r\n<br />\r\nLe centre de gestion</p>\r\n<p>&nbsp;</p>', 0),
(47, '2005-10-21', 'Administrateur', '2006-07-12', 'Administrateur', 'CON_AR_XXX_CDG', '', 'CONTRAT : Email envoyé vers le CDG pour accusé de réception', 'Bonjour,<br /><br />Nous vous signalons la r&eacute;ception d''un contrat sign&eacute; (N&deg; <strong>%cocl_code%</strong>).<br /><br />Bonne fin de journ&eacute;e.', 0),
(48, '2005-10-21', 'Administrateur', '2007-04-05', 'Administrateur', 'CON_AR_XXX_AGE', '', 'CONTRAT : Email envoyé vers l''agence suite à accusé de réception', '%logo_cge%<br />\r\n%cge_adr1%<br />\r\n%cge_adr2%<br />\r\n%cp_cge% %ville_cge%<br />\r\nTel : %cge_telf%<br />\r\nFax : %cge_fax%<br /><br />\r\n<blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote>\r\n<p><strong>%age_nom%</strong><br />\r\n%age_adr1%<br />\r\n%age_adr2%<br />\r\n%cp_age% %ville_age%<br />\r\nTel : %age_telf%<br />\r\nFax : %age_fax%</p>\r\n</blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>\r\n<p>&nbsp;&nbsp;</p>\r\n<p><strong>A l''attention de %age_resp_civilite% %age_resp_prenom% %age_resp_nom%</strong></p>\r\n<p>%civiliter1M_age%,<br />\r\n<br />\r\nNous vous signalons la r&eacute;ception d''un contrat sign&eacute; (N&deg; <strong>%cocl_code%</strong>).  <br />\r\n<br />\r\nBonne fin de journ&eacute;e.</p>\r\n<p>Le centre gestion</p>', 0);
