(49, '2005-10-19', 'Administrateur', '2007-04-02', 'Administrateur', 'CON_CGV_MASTER', '', 'CONTRATS : Texte master des conditions générales de vente', '<p>Les soussign&eacute;es :</p>\r\n<blockquote><strong>%age_nom%</strong><br />\r\n%age_adr1%   <br />\r\n%age_adr2%   <br />\r\n%cp_age% %ville_age%<br />\r\n%age_rcs%    </blockquote>\r\n<p><br />\r\nappel&eacute;e le &quot;PRESTATAIRE&quot;, d''une part,  et</p>\r\n<blockquote><strong>%cli_ste%</strong><br />\r\n%cli_adr1%   <br />\r\n%cli_adr2%   <br />\r\n%cp_cli% %ville_cli%<br />\r\n%cli_rcs%    </blockquote>\r\n<p><br />\r\nappel&eacute;e le &quot;CLIENT&quot;, d''autre part,  ont convenus de ce qui suit :<br />\r\n<br />\r\n<font size="5"><u><strong>Article I : Objet du contrat</strong></u></font><br />\r\n<br />\r\n1.1. Le pr&eacute;sent contrat a pour objet de d&eacute;finir l''ensemble des conditions qui s''appliqueront &agrave; toute prestation d''assistance technique dont le client est susceptible de commander l''ex&eacute;cution au prestataire pendant la dur&eacute;e d&eacute;finie au pr&eacute;sent contrat. <br />\r\n1.2. Le pr&eacute;sent contrat a pour objet la t&eacute;l&eacute;maintenance des logiciels et syst&egrave;mes des mat&eacute;riels d&eacute;crits dans l''annexe A. <br />\r\n1.3. Ce document d&eacute;finit les modalit&eacute;s du contrat de maintenance des &eacute;quipements et des ordinateurs install&eacute;s &agrave; l''adresse du client. <br />\r\n1.4. Il est pr&eacute;cis&eacute; que cette assistance ne comprend pas la maintenance ou le remplacement des supports magn&eacute;tiques et consommables tels que disques, cartouches, disquettes, cartouches d''encre, toners, ni les interventions sur site ou en atelier du prestataire. <br />\r\n1.5.Le forfait comprend une maintenance pr&eacute;ventive, curative et &eacute;volutive</p>\r\n<blockquote><em><u>Maintenance pr&eacute;ventive</u></em><br />\r\nElle consiste en un contr&ocirc;le des applications et syst&egrave;mes, et leur bonne utilisation. L''entretien logiciel lors de cette intervention consistera &agrave; &eacute;liminer des fichiers temporaires et inutiles (avec le personnel), &agrave; nettoyer les disques contre les virus informatiques (si v&eacute;rification), la validit&eacute; des antivirus, et &agrave; r&eacute;organiser et optimiser les syst&egrave;mes et logiciels. <br />\r\n<br />\r\n<em><u>Maintenance curative</u></em><br />\r\nElle sera appliqu&eacute;e dans la mesure o&ugrave; le syst&egrave;me pr&eacute;sente des anomalies de fonctionnement ou lorsque la panne est de la responsabilit&eacute; du client (probl&egrave;mes d''alimentation &eacute;lectrique, panne d''onduleur, erreur d''exploitation...).<br />\r\nElle comprend :<br />\r\n<blockquote>L''assistance t&eacute;l&eacute;phonique o&ugrave; le client suit les indications donn&eacute;es par t&eacute;l&eacute;phone;<br />\r\nLa connexion par t&eacute;l&eacute;maintenance (uniquement si possible) pour le diagnostic et la r&eacute;paration de tous les probl&egrave;mes logiciels et syst&egrave;mes. </blockquote>  <br />\r\n<em><u>Maintenance &eacute;volutive</u></em><br />\r\nElle comprend :  <br />\r\n<blockquote>Les am&eacute;liorations li&eacute;es aux &eacute;volutions de l''environnement technique ou de la normalisation ;<br />\r\nL''installation de nouvelles fonctionnalit&eacute;s, mises &agrave; jours logicielles.</blockquote>  </blockquote>\r\n<p><br />\r\n<u><font size="5"><strong>Article II : Entretien</strong></font></u><br />\r\n<br />\r\n2.1. Le prestataire assurera un contr&ocirc;le afin de v&eacute;rifier la bonne marche des logiciels et syst&egrave;mes et effectuera &agrave; cette occasion les op&eacute;rations d''entretien courant &eacute;ventuellement n&eacute;cessaires. Le technicien charg&eacute; de l''entretien proc&eacute;dera aux v&eacute;rifications, r&eacute;glages, optimisations des logiciels et syst&egrave;mes.<br />\r\n2.2. La p&eacute;riodicit&eacute; de ces connexions de contr&ocirc;le sera fix&eacute;e par le prestataire en fonction des n&eacute;cessit&eacute;s techniques.<br />\r\n<br />\r\n<u><font size="5"><strong>Article III : D&eacute;pannage</strong></font></u><br />\r\n<br />\r\n3.1. Sur appel motiv&eacute; du client signalant une anomalie de fonctionnement ou une panne, ou sur p&eacute;riode pr&eacute;alablement &eacute;tablie, le prestataire se connectera pour d&eacute;panner les logiciels et syst&egrave;mes dans les d&eacute;lais les plus brefs. <br />\r\n3.2. Les interventions auront lieu dans les %cocl_delai% heures suivant l''appel du client. <br />\r\n3.3. Une assistance &agrave; distance est propos&eacute;e pour les probl&egrave;mes de mat&eacute;riel. <br />\r\nCette assistance est propos&eacute;e pendant les horaires d''ouverture de l''agence %age_nom%, soit : %age_heures%. <br />\r\n<br />\r\n<u><font size="5"><strong>Article IV : Exclusions</strong></font></u><br />\r\n<br />\r\nSont exclues du pr&eacute;sent contrat et donneront lieu &agrave; une facturation s&eacute;par&eacute;e les interventions dues aux faits suivants :</p>\r\n<ul>\r\n    <li>Non-respect des normes d''entretien par le client,</li>\r\n    <li>Utilisation anormale ayant entra&icirc;n&eacute; des d&eacute;g&acirc;ts ou accidents, n&eacute;gligence ou faute du personnel du client,</li>\r\n    <li>Adjonctions ou connexions de mat&eacute;riel ou d''unit&eacute; d''une autre marque,</li>\r\n    <li>Modifications des sp&eacute;cifications de la machine,</li>\r\n    <li>Utilisation de fournitures autres que celles pr&eacute;conis&eacute;es par le prestataire,</li>\r\n    <li>Variations ou d&eacute;faillances du courant &eacute;lectrique ou pannes t&eacute;l&eacute;phoniques,</li>\r\n    <li>Modifications du logiciel provoquant un mauvais fonctionnement, programmation incorrecte,</li>\r\n    <li>D&eacute;faillance de la climatisation ou du contr&ocirc;le hygrom&eacute;trique,</li>\r\n    <li>R&eacute;parations ou entretien effectu&eacute;s par des personnes &eacute;trang&egrave;res au prestataire,</li>\r\n    <li>D&eacute;placement ou transport du mat&eacute;riel,</li>\r\n    <li>Usage anormalement intensif du mat&eacute;riel.</li>\r\n</ul>\r\n<p><br />\r\n<strong><u><font size="5">Article V : Registre des anomalies</font></u><br />\r\n</strong>Le client devra tenir un registre sur lequel il devra consigner toutes les anomalies, incidents ou pannes concernant le mat&eacute;riel; il devra, en outre, indiquer dans ce registre tous les faits ayant entra&icirc;n&eacute; ou susceptibles d''entra&icirc;ner une anomalie dans le bon fonctionnement. <br />\r\n<br />\r\n<font size="5"><u><strong>Article VI : Acc&egrave;s au mat&eacute;riel</strong></u></font><br />\r\n<br />\r\n6.1. Le client s''engage &agrave; laisser au personnel employ&eacute; par le prestataire le libre acc&egrave;s par t&eacute;l&eacute;maintenance au mat&eacute;riel couvert par le pr&eacute;sent contrat; il lui laissera un acc&egrave;s complet, lui assurera l''assistance n&eacute;cessaire, et devra notamment mettre &agrave; sa disposition les op&eacute;rateurs et le mat&eacute;riel n&eacute;cessaires &agrave; l''ex&eacute;cution des travaux de r&eacute;paration.<br />\r\n6.2. Les interventions seront effectu&eacute;es par les techniciens d&eacute;l&eacute;gu&eacute;s par le prestataire, pendant les heures normales de travail ouvrables (%age_heures).<br />\r\nSi les interventions sont effectu&eacute;es en dehors des heures normales de travail, ou les samedis, dimanches ou jours f&eacute;ri&eacute;s, les d&eacute;placements et interventions seront factur&eacute;s en sus, suivant les tarifs en vigueur. <br />\r\n6.3. Au cas o&ugrave; le technicien du prestataire ne pourrait avoir acc&egrave;s par t&eacute;l&eacute;maintenance au mat&eacute;riel du fait du client, le temps pass&eacute; par le technicien serait alors factur&eacute; en suppl&eacute;ment.<br />\r\n<br />\r\n<font size="5"><u><strong>Article VII : Obligations du client</strong></u></font><br />\r\n<br />\r\n7.1. Le client s''engage &agrave; respecter les conditions normales d''utilisation du mat&eacute;riel et &agrave; appliquer strictement toutes les instructions donn&eacute;es par le prestataire.<br />\r\n7.2. Le mat&eacute;riel, les &eacute;quipements et leur installation devront &ecirc;tre conformes aux normes fournies par le prestataire, ainsi que le local, les installations &eacute;lectriques et les supports d''information. <br />\r\n7.3. Le mat&eacute;riel et son param&eacute;trage ne pourront &ecirc;tre modifi&eacute;s, d&eacute;plac&eacute;s, r&eacute;par&eacute;s par des tiers sans l''autorisation pr&eacute;alable &eacute;crite du prestataire.<br />\r\n7.4. Les fournitures utilis&eacute;es avec le mat&eacute;riel (papier, bandes, disquettes...) devront correspondre strictement aux fournitures agr&eacute;&eacute;es par le prestataire.<br />\r\nEn cas de non-respect de l''une des dispositions du contrat ou des obligations pr&eacute;cis&eacute;es, le prestataire pourra mettre fin au pr&eacute;sent contrat en respectant un pr&eacute;avis d''un mois.<br />\r\n<br />\r\n<u><font size="5"><strong>Article VIII : Limitation de responsabilit&eacute;</strong></font></u><br />\r\n<br />\r\n8.1. Le prestataire sera d&eacute;gag&eacute; de toute responsabilit&eacute; en cas d''inobservation par le client d''une des clauses du pr&eacute;sent contrat, ou en cas de survenance de l''un des faits pr&eacute;vus dans le chapitre &quot; exclusions &quot;.<br />\r\n8.2. Le prestataire ne pourra en aucun cas &ecirc;tre consid&eacute;r&eacute; comme responsable des dommages directs ou indirects r&eacute;sultant de l''utilisation du mat&eacute;riel et des logiciels, y compris en cas de pertes de donn&eacute;es ou d''information. Le client s''engage &agrave; se pr&eacute;munir contre ces risques en effectuant au minimum une sauvegarde quotidienne de l''ensemble des informations.<br />\r\n8.3. Le prestataire ne pourra &ecirc;tre rendu responsable des pannes ou anomalies de fonctionnement du mat&eacute;riel, quelle que puisse &ecirc;tre la dur&eacute;e de la panne ou de l''immobilisation avant la remise en marche normale.<br />\r\n8.4. Enfin, la responsabilit&eacute; du prestataire ne pourra &ecirc;tre recherch&eacute;e en cas de force majeure, ou pour d''autres motifs ind&eacute;pendants de sa volont&eacute; tels que gr&egrave;ves, interruptions du travail, retard des prestataires, sinistres ou accidents, interruptions de communication internet ou t&eacute;l&eacute;phonique, conflits, piratage de r&eacute;seau ou d''informations.<br />\r\n8.5. En toute hypoth&egrave;se, si la responsabilit&eacute; du prestataire est engag&eacute;e, l''indemnisation qui pourrait lui &ecirc;tre r&eacute;clam&eacute;e est limit&eacute;e au montant de la redevance per&ccedil;ue par le prestataire au titre de la p&eacute;riode de douze mois en cours.<strong><br />\r\n<br />\r\n<font size="5"><u>Article IX : Dur&eacute;e du contrat</u></font></strong><br />\r\n<br />\r\n9.1. Le pr&eacute;sent contrat est conclu &agrave; compter du %cocl_dated%, jusqu''au %cocl_datef%.<br />\r\n9.2. Il se poursuivra ensuite par tacite reconduction par p&eacute;riodes d''un an, sauf d&eacute;nonciation par l''une ou l''autre des parties, en respectant un pr&eacute;avis de %cocl_preavis% jours au moins avant la fin de la p&eacute;riode en cours, notifi&eacute;e par lettre recommand&eacute;e AR.<strong><br />\r\n<br />\r\n<font size="5"><u>Article X : Prix</u></font></strong><br />\r\n<br />\r\n10.1. Le montant HT, de la maintenance telle que pr&eacute;vue dans le pr&eacute;sent contrat est fix&eacute; dans l''annexe B.<br />\r\nCe prix ne concerne que le mat&eacute;riel figurant en annexe A.<br />\r\nEn cas de modification ou d''adjonction de mat&eacute;riel, le prix serait modifi&eacute; en cons&eacute;quence.<br />\r\n10.2. Le prix est pr&eacute;vu pour un mat&eacute;riel utilis&eacute; par une seule &eacute;quipe de personnel.<br />\r\n10.3. Ce tarif pourra &ecirc;tre r&eacute;vis&eacute; ou modifi&eacute; par le prestataire dans le cadre des lois et r&egrave;glements en vigueur en respectant un pr&eacute;avis d''un mois. <br />\r\nPendant le mois qui suivra la notification du nouveau prix, le client aura la possibilit&eacute; de r&eacute;silier le pr&eacute;sent contrat; faute par lui de le faire, la notification de prix s''appliquera &agrave; la date pr&eacute;vue.<br />\r\n<br />\r\n<u><font size="5"><strong>Article XI : Conditions de paiement</strong></font></u><br />\r\n<br />\r\n11.1. Le co&ucirc;t de la maintenance est factur&eacute; d''avance chaque ann&eacute;e.<br />\r\n11.2. Les frais suppl&eacute;mentaires sont factur&eacute;s d&egrave;s qu''ils ont &eacute;t&eacute; expos&eacute;s.<br />\r\n11.3. Les factures sont payables &agrave; r&eacute;ception, net, comptant, sans escompte.<br />\r\n<br />\r\n<font size="5"><u><strong>Article XII : Attribution de juridiction</strong></u></font><br />\r\n<br />\r\nLes pr&eacute;c&eacute;dentes conditions ainsi que les actes qui en seront la cons&eacute;quence sont soumis au droit fran&ccedil;ais. Pour tout litige susceptible de survenir, l''attribution expresse de juridiction est faite aux tribunaux de %age_tcom%.<br />\r\n<br />\r\nFait en autant d''exemplaires que de parties aux pr&eacute;sentes, &agrave; %age_tcom% le %cocl_datesig%<br />\r\n<br />\r\n<strong>Pour le prestataire :</strong> <br />\r\n<em>Nom, pr&eacute;nom (Lettres capitales), qualit&eacute;, signature, et tampon</em><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Pour le client :</strong> <br />\r\n<em>Nom, pr&eacute;nom (Lettres capitales), qualit&eacute;, signature, et tampon</em><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n</p>\r\n<p>\r\n<div style="page-break-after: always;"><span style="display: none;">&nbsp;</span></div>\r\n</p>\r\n<div align="center"><strong><font size="5"><u>ANNEXE A</u></font></strong></div>\r\n<p>%cocl_matos%</p>\r\n<br />\r\n<em>Les appareils objet du contrat doivent &ecirc;tre en bon &eacute;tat de fonctionnement &agrave; la date du d&eacute;part du contrat.</em>\r\n<p>&nbsp;</p>\r\n<div style="page-break-after: always;"><span style="display: none;">&nbsp;</span></div>\r\n<div align="center"><strong><font size="5"><u>ANNEXE B</u></font></strong><br /></div>\r\n<p>Montant hors taxes du contrat : %cocl_pvht%&euro;</p>', 0),
(50, '2005-10-16', 'Administrateur', '2007-04-05', 'Administrateur', 'CON_REL_XXX_CLI', '', 'CONTRAT : Email renvoyé vers un client si contrat pas retourné', '%logo_age%<strong><br />\r\n%age_adr1%<br />\r\n%age_adr2%<br />\r\n%cp_age% %ville_age%</strong><br />\r\nTel : %age_telf%<br />\r\nFax : %age_fax%<br /><br />\r\n<blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><strong>%cli_ste%</strong><br />\r\n<strong> %cli_civilite% %cli_prenom% %cli_nom%</strong><br />\r\n<strong> %cli_adr1%</strong><br />\r\n<strong> %cli_adr2%</strong><br />\r\n<strong> %cp_cli% %ville_cli% </strong><br />\r\n<strong> Tel : %cli_telf%</strong><br />\r\n<strong> Fax : %cli_fax%</strong></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>\r\n<p><br />\r\n%civilite1M_cli%,<br />\r\n<br />\r\nNous n''avons pas accus&eacute; r&eacute;ception du contrat N&deg;<strong>%cocl_code%</strong> qui vous a &eacute;t&eacute; envoy&eacute; le %cocl_dateenv%.<br />\r\n<br />\r\nPouvez-vous faire le n&eacute;cessaire pour nous le retourner tamponn&eacute;, paraph&eacute;, et sign&eacute; en deux exemplaires originaux, sous les meilleurs d&eacute;lais ? <br />\r\n<br />\r\nSi vous le souhaitez, vous pouvez le charger directement sur notre site :  <a href="http://%cge_web%">%cge_web%</a>  .</p>\r\n<p>Si toutefois ce contrat avait d&eacute;j&agrave; &eacute;t&eacute; retourn&eacute;, nous vous demandons de nous contacter au %age_telf%.</p>\r\n<p>Nous vous souhaitons une excellente fin de journ&eacute;e et vous prions d''agr&eacute;er, %civilite1M_cli%,&nbsp; l''expression de nos sentiments les plus d&eacute;vou&eacute;s.  <br />\r\n<br />\r\nLe centre de gestion</p>', 0),
