(57, '2005-12-06', 'Administrateur', '2007-04-05', 'Administrateur', 'CDG_CRE_XXX_CDG', '', 'CENTRE DE GESTION : Email envoyé vers le CDG suite à création par l''admin', '<p>Bonjour,<br />\r\n<br />\r\nC''est avec plaisir que nous vous confirmons la cr&eacute;ation de votre compte.<br />\r\n<br />\r\nVoici vos codes de connexion et mot de passe :</p>\r\n<blockquote>Code de connexion : <strong>%cge_code%</strong><br />\r\nMot de passe          : <strong>%pass%</strong></blockquote>\r\n<p><br />\r\nConservez pr&eacute;cieusement ces informations pour pouvoir vous connecter et suivre vos dossiers techniques sur notre site <a href="http://%cge_web%">%cge_web%</a> (menu &quot;Connectez-vous &agrave; votre espace priv&eacute;&quot;).<br />\r\n<br />\r\nBonne fin de journ&eacute;e.<br />\r\n<br />\r\nL''administrateur du site <a href="http://%cge_web%">%cge_web%</a></p>', 0),
