(59, '2005-12-15', 'Administrateur', '2007-04-05', 'Administrateur', 'INT_CRE_XXX_CLI', '', 'CLIENT : Email envoyé vers le client suite à création d''une intervention', '<p>%logo_age%<br />\r\n%age_adr1%<br />\r\n%age_adr2%<br />\r\n%cp_age% %ville_age%<br />\r\nTel : %age_telf%<br />\r\nFax : %age_fax%</p>\r\n<blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote>\r\n<p><strong>%cli_ste%<br />\r\n%cli_civilite% %cli_prenom% %cli_nom%</strong><br />\r\n%cli_adr1%<br />\r\n%cli_adr2%<br />\r\n%cp_cli% %ville_cli%<br />\r\nTel : %cli_telf%<br />\r\nFax : %cli_fax%</p>\r\n</blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>\r\n<p>%civilite1M_cli%,  <br />\r\n<br />\r\nC''est avec plaisir que nous vous confirmons la mise en place de votre intervention <em><strong>%int_code%</strong></em>.  <br />\r\n<br />\r\nVous pouvez d''ores et d&eacute;j&agrave; vous connecter sur notre site <a href="http://%cge_web%">%cge_web%</a>  (menu &quot;Espace priv&eacute;&quot;) pour suivre ce dossier.  <br />\r\n<br />\r\nNous vous souhaitons une excellente fin de journ&eacute;e et vous prions d''agr&eacute;er, %civilite1M_cli%,&nbsp; l''expression de nos sentiments les plus d&eacute;vou&eacute;s.  <br />\r\n<br />\r\nLe centre technique</p>', 0),
(60, '2005-12-22', 'Administrateur', '2006-02-10', 'Administrateur', 'CGV_SAV', '', 'Texte des conditions générales de vente SAV', 'Le client certifie que le matériel ci-dessus indiqué n''a pas été ouvert ou modifié par du personnel non qualifié, et que ce matériel n''a subit aucun dommage pouvant annuler une garantie constructeur. Au cas où le matériel serait sous garantie, gérable par <B>%age_nom%</B>, le client s''engage à fournir une copie de sa facture d''achat et accepte, s''il ne peut pas la fournir, que ce matériel ne soit pas traité sous garantie. Le client s''engage à fournir tout logiciel original, documentation, connectique, et accessoires, codes et mots de passes permettant à la société <B>%age_nom%</B> de remettre son matériel en état de fonctionnement. La société <B>%age_nom%</B> ne saurait être tenue pour responsable de retard en cas de manque ou d''erreur dans les éléments sus-cités ou, dans le cas d''un changement de pièce, d''un retard de livraison ou d''une rupture de stock d''un de ses fournisseurs. <B>%age_nom%</B> ne saurait être tenue pour responsable des éventuelles pertes de données durant la réparation. En cas de réparation atelier, dès que le client a été prévenu, il s''engage à récupérer ou a demander la remise en place de son matériel dans les 6 jours ouvrés suivant la date où il aura été prévenu. Passé ce délai, <B>%age_nom%</B> se réserve le droit de facturer des frais de garde et d''assurance. En cas de réparation sur site sous contrat, le client s''engage à fournir au préalable copie de son contrat de maintenance, faute de quoi il reconnait devoir les frais de déplacement et d''intervention. Les frais de livraison ou de retour du matériel restent à la charge du client. Toutes les prestations seront effectuées aux tarifs en vigueur, dont le client reconnait avoir pris connaissance. Toute intervention n''ayant pu s''effectuer du fait du client ou dont l''annulation n''a pas été signalée au moins 3 jours ouvrés à l''avance se verra facturée au forfait minimum en vigueur sur la zone de déplacement du client. Si, suite à un devis de réparation refusé, le client ne souhaite pas récupérer son matériel, ou s''il ne souhaite pas, en cas de réparation effectuée, conserver ses anciennes pièces, <B>%age_nom%</B> se réserve le droit de facturer des frais de recherche et/ou des frais de destruction du matériel ou des pièces. Le client accepte ces conditions sans réserve.', 0),
(61, '0000-00-00', '', '2007-04-05', 'Administrateur', 'INT_FAIT_XXX_CLI', '', 'INTERVENTION : Email envoyé vers un client si intervention close', '<p>%logo_age%<br />\r\n<strong>%age_adr1%<br />\r\n%age_adr2%<br />\r\n%cp_age% %ville_age%<br />\r\nTel : %age_telf%<br />\r\nFax : %age_fax%</strong></p>\r\n<p>&nbsp;</p>\r\n<p><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><strong>%cli_ste%</strong><br />\r\n<strong> %cli_civilite% %cli_prenom% %cli_nom%</strong><br />\r\n%cli_adr1%<br />\r\n%cli_adr2%<br />\r\n%cp_cli% %ville_cli% <br />\r\nTel : %cli_telf%<br />\r\nFax : %cli_fax%</blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>  <br />\r\n%civilite1M_cli%,</p>\r\n<p>C''est avec plaisir que nous vous annon&ccedil;ons que votre dossier d''intervention (<strong>N&deg; %int_code%</strong>) est r&eacute;solu.  <br />\r\n<br />\r\nLe montant de votre r&eacute;paration est de <em><strong>%total%&euro;</strong></em>.  <br />\r\n<br />\r\nVous pouvez en obtenir le d&eacute;tail sur notre site :  <a href="http://%cge_web%">%cge_web%</a>  .<br />\r\n<br />\r\nSi vous ne l''avez pas d&eacute;j&agrave; fait, vous pouvez prendre contact avec notre agence <strong>%age_nom%</strong> (<em>horaires : %age_heures%</em>), au <strong>%age_telf%</strong>, pour la livraison de votre mat&eacute;riel, ou simplement passer le r&eacute;cup&eacute;rer.  <br />\r\n<br />\r\nNous vous souhaitons une excellente fin de journ&eacute;e et vous prions d''agr&eacute;er, %civilite1M_cli%,&nbsp; l''expression de nos sentiments les plus d&eacute;vou&eacute;s.  <br />\r\n<br />\r\nLe service technique</p>', 0),
(63, '2005-10-16', 'Administrateur', '2007-08-10', 'Administrateur', 'CON_REN_XXX_CLI', '', 'CONTRAT : Email renvoyé vers un client pour proposition de renouvellement', '<p>%logo_cge%<br />\r\n<strong>%cge_adr1%<br />\r\n%cge_adr2%<br />\r\n%cp_cge% %ville_cge%<br />\r\nTel : %cge_telf%<br />\r\nFax : %cge_fax%</strong></p>\r\n<blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><strong>%cli_ste%</strong><br />\r\n<strong> %cli_civilite% %cli_prenom% %cli_nom%</strong><br />\r\n<strong> %cli_adr1%</strong><br />\r\n<strong> %cli_adr2%</strong><br />\r\n<strong> %cp_cli% %ville_cli% </strong><br />\r\n<strong> Tel : %cli_telf%</strong><br />\r\n<strong> Fax : %cli_fax%</strong></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>\r\n<p><br />\r\n%civilite1M_cli%,  <br />\r\n<br />\r\nVotre contrat N&deg;%cocl_code% arrive prochainement &agrave; &eacute;ch&eacute;ance.<br />\r\n<br />\r\nConform&eacute;ment aux conditions commerciales, et afin de ne pas interrompre votre maintenance, nous avons d''ores et d&eacute;j&agrave; mis en place le contrat <strong>%cocl_rnum%</strong>.</p>\r\n<p>Vous pouvez vous connecter et t&eacute;l&eacute;charger ce dernier sur notre site <a href="http://%cge_web%">%cge_web%</a> (menu &quot;Espace priv&eacute;&quot;), et nous le retourner, paraf&eacute;, tamponn&eacute; et sign&eacute; en deux exemplaires.</p>\r\n<p>N''h&eacute;sitez pas &agrave; contacter votre agence %age_nom% au %age_telf% pour tout renseignement compl&eacute;mentaire.  <br />\r\n<br />\r\nDans l''attente de votre appel et vous remerciant encore de votre confiance,  <br />\r\n<br />\r\nNous vous prions d''agr&eacute;er, %civilite1M_cli%, l''expression de nos sentiments les plus d&eacute;vou&eacute;s.  <br />\r\n<br />\r\nLe centre de gestion</p>', 0),
(65, '2006-01-17', 'Administrateur', '2008-08-29', 'Administrateur', 'DDE_CRE_PRI_XXX', '', 'DEMANDE : Email envoyé vers le destinataire suite à demande PRIVEE', '<p>Bonjour,<br />\r\n<br />\r\nUn nouveau message depuis l''espace <strong>priv&eacute;</strong> vous a &eacute;t&eacute; exp&eacute;di&eacute; le %dde_datecrea%.  <br />\r\n<br />\r\nEn voici le d&eacute;tail :<br />\r\n&nbsp;====================================  <br />\r\n<strong>OBJET :</strong> <br />\r\n%ddet_desc%  <strong><br />\r\nExp&eacute;diteur :</strong> <br />\r\n%dde_ste% <br />\r\n%dde_civilite% %dde_prenom% %dde_nom% <br />\r\n%dde_adr1% <br />\r\n%dde_adr2% <br />\r\n%cp_dde% %ville_dde% <br />\r\nTel. : %dde_telf% <br />\r\nFax : %dde_fax% <br />\r\nPor : %dde_telp%  <strong><br />\r\nEmail :</strong> <a href="mailto:%dde_email%">%dde_email%</a>    <br />\r\n<strong> Site concern&eacute; :</strong><br />\r\n%txt_scliv%<br />\r\n<strong> Urgence :</strong><br />\r\n%urg_dde%</p>\r\n<p><strong>Message :</strong><br />\r\n%dde_txtdde%  <br />\r\n====================================  <br />\r\n<br />\r\nBonne fin de journ&eacute;e.</p>', 0),
(66, '2006-01-17', 'Administrateur', '2007-07-06', 'Administrateur', 'DDE_CRE_PUB_XXX', '', 'DEMANDE : Email envoyé vers le destinataire suite à demande PUBLIQUE', '<p>Bonjour,<br />\r\n<br />\r\nUn nouveau message depuis l''espace <strong>publique</strong> vous a &eacute;t&eacute; exp&eacute;di&eacute; le %dde_datecrea%.  <br />\r\n<br />\r\nEn voici le d&eacute;tail :<br />\r\n&nbsp;====================================  <br />\r\n<strong>OBJET :</strong> <br />\r\n%ddet_desc%  <strong><br />\r\nExp&eacute;diteur :</strong> <br />\r\n%dde_ste%<br />\r\n%dde_civilite% %dde_prenom% %dde_nom%<br />\r\n%dde_adr1%<br />\r\n%dde_adr2%<br />\r\n%cp_dde% %ville_dde%<br />\r\nTel. : %dde_telf%<br />\r\nFax : %dde_fax%<br />\r\nPor : %dde_telp%  <strong><br />\r\nEmail :</strong> <a href="mailto:%dde_email%">%dde_email%</a>   <strong><br />\r\nMessage :</strong></p>\r\n<p>%dde_txtdde%  <br />\r\n====================================<br />\r\n<br />\r\nBonne fin de journ&eacute;e.</p>', 0),
(68, '2006-02-06', 'Administrateur', '2006-02-06', 'Administrateur', 'CON_PUBCPR', '', 'CONTRATS : Texte affiché sous les descriptifs contrats type pour les clients (espace privé)', 'Tous ces contrats sont modulaires et entièrement paramétrables selon votre volonté et vos besoins.Nous pouvons ainsi les proposer :<ul><li>Pour une intervention ponctuelle</li><li>Sur des interventions en cas de pannes ou d''anomalies</li><li>Sur des interventions rémanentes programmées</li><li>Sur la base de quotas horaires que vous pouvez utiliser en fonction de vos besoins</li><li>Dans le cadre de la délégation de techniciens en vos locaux</li><li>Etc...</li></ul>A vos propres rythmes et sous des délais d''intervention qui peuvent également être modulés selon vos désiratas ou pour des urgences ponctuelles.Il peuvent enfin être combinés (contrats serveurs + contrats stations, contrats matériels seuls + contrats télémaintenances, etc...) pour une optimisation maximale de votre maintenance et une pérennisation de votre matériel.Le tout sur des périodes que <B>vous</B> choisissez.Vous avez donc à votre disposition un très grand choix et une très grande souplesse de décision, tout en respectant vos impératifs budgétaires et techniques.<p align="right">N''hésitez plus et <a href="dde_maj.php?ori=pr">contactez-nous</a>.</p>', 0),
(69, '2006-02-10', 'Administrateur', '2007-04-05', 'Administrateur', 'CLI_DEM_XXX_CLI', '', 'CLIENT : Email envoyé vers le CLI suite à modification pour déménagement', '%logo_cge%<br />\r\n<strong>%cge_adr1%<br />\r\n%cge_adr2%<br />\r\n%cp_cge% %ville_cge%<br />\r\nTel : %cge_telf%<br />\r\nFax : %cge_fax%</strong><br /><br />\r\n<p>&nbsp;</p>\r\n<blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><strong>%cli_ste%</strong><br />\r\n<strong> %cli_civilite% %cli_prenom% %cli_nom%</strong><br />\r\n<strong> %cli_adr1%</strong><br />\r\n<strong> %cli_adr2%</strong><br />\r\n<strong> %cp_cli% %ville_cli% </strong><br />\r\n<strong> Tel : %cli_telf%</strong><br />\r\n<strong> Fax : %cli_fax%</strong></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>\r\n<p><br />\r\n%civilite1M_cli%,  <br />\r\n<br />\r\nNous vous confirmons la mise &agrave; jour de vos coordonn&eacute;es suite &agrave; votre d&eacute;m&eacute;nagement.<br />\r\n<br />\r\nVotre code client est toujours le <strong>%cli_code%</strong> et vos codes de connexion restent inchang&eacute;s.  <br />\r\n<br />\r\nNous vous souhaitons une excellente fin de journ&eacute;e.</p>\r\n<p>&nbsp;</p>\r\n<p>Le centre de gestion</p>', 0),
