(75, '2006-02-04', 'Administrateur', '2006-02-13', 'Administrateur', 'CON_PUBCPU', '', 'CONTRATS : Texte affiché sous les descriptifs contrats type pour les clients (espace publique)', 'Tous ces contrats sont modulaires et entièrement paramétrables selon votre volonté et vos besoins.Nous pouvons ainsi les proposer :<ul><li>Pour une intervention ponctuelle</li><li>Sur des interventions en cas de pannes ou d''anomalies</li><li>Sur des interventions rémanentes programmées</li><li>Sur la base de quotas horaires que vous pouvez utiliser en fonction de vos besoins</li><li>Dans le cadre de la délégation de techniciens en vos locaux</li><li>Etc...</li></ul>A vos propres rythmes et sous des délais d''intervention qui peuvent également être modulés selon vos désiratas ou pour des urgences ponctuelles.Il peuvent enfin être combinés (contrats serveurs + contrats stations, contrats matériels seuls + contrats télémaintenances, etc...) pour une optimisation maximale de votre maintenance et une pérennisation de votre matériel.Le tout sur des périodes que <B>vous</B> choisissez.Vous avez donc à votre disposition un très grand choix et une très grande souplesse de décision, tout en respectant vos impératifs budgétaires et techniques.<p align="right">N''hésitez plus et <a href="ddemail.php?ori=pu">contactez-nous</a>.</p>', 0),
