(110, '2006-11-14', 'Administrateur', '2007-07-22', 'Administrateur', 'INT_ACC_CLI', '', 'Interventions : Texte pour attente confirmation client', 'Vous voudrez bien trouver ci-dessus notre proposition d''intervention.<br />\r\nCette proposition s''entend uniquement pour le mat&eacute;riel d&eacute;crit ci-dessus, &agrave; l''adresse indiqu&eacute;e, et implique l''acceptation totale de votre part de nos conditions commerciales et tarifaires, ainsi que nos conditions g&eacute;n&eacute;rales de vente.<br />\r\nEn cas d''accord, nous vous demandons de bien vouloir nous la retourner, paraph&eacute;e, tamponn&eacute;e et sign&eacute;e, avec la mention &quot;bon pour intervention&quot;.<br />\r\nVous remerciant encore de la confiance que vous nous accordez, et restant &agrave; votre enti&egrave;re disposition pour tout renseignement compl&eacute;mentaire,<br />\r\nNous vous prions d''agr&eacute;er, %civilite1M_cli%, &agrave; l''expression de nos sentiments les plus d&eacute;vou&eacute;s.<br /><br />\r\nLe service technique<br />\r\n<font size="3"><em>P.S. : L''heure not&eacute;e est indicative et peut varier en fonction des conditions de circulation.</em></font>', 0),
