(165, '2007-09-15', 'Administrateur', '2007-09-15', 'Administrateur', 'PIED_RETD', '', 'Pied de retour (demandes)', 'Merci de r&eacute;pondre rapidement &agrave; cette demande de retour.<br />Conform&eacute;ment &agrave; nos conditions g&eacute;n&eacute;rales, nous nous r&eacute;servons le droit, en cas de retard, de d&eacute;compter des p&eacute;nalit&eacute;s de retard.<br />En cas de besoin, vous pouvez nous contacter&nbsp; aux coordonn&eacute;es et horaires en ent&ecirc;te.', 0),
(166, '2007-09-15', 'Administrateur', '2007-09-15', 'Administrateur', 'PIED_RETE', '', 'Pied de retour (envois)', 'Merci de proc&eacute;der rapidement au traitement de ces retours.<br />%age_nom% se r&eacute;serve le droit de d&eacute;compter des p&eacute;nalit&eacute;s de retard si nos conditions commerciales n''&eacute;taient pas respect&eacute;es.<br />En cas de probl&egrave;me quelconque, n''h&eacute;sitez pas &agrave; nous contacter.', 0),
(167, '2007-10-01', 'Administrateur', '2007-10-01', 'Administrateur', 'RETR_CRE_XXX_AGE', '', 'TRAITEMENT RETOUR : Email envoyé vers une agence suite à saisie fiche', '<p>%logo_cge%<br />\r\n%cge_adr1%<br />\r\n%cge_adr2%<br />\r\n%cp_cge% %ville_cge%<br />\r\nTel : %cge_telf%<br />\r\nFax : %cge_fax%</p>\r\n<blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote>\r\n<p><strong>%age_nom%</strong><br />\r\n%age_adr1%<br />\r\n%age_adr2%<br />\r\n%cp_age% %ville_age%<br />\r\nTel : %age_telf%<br />\r\nFax : %age_fax%</p>\r\n</blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>\r\n<p>&nbsp;&nbsp;</p>\r\n<p><strong>A l''attention de %age_resp_civilite% %age_resp_prenom% %age_resp_nom%</strong></p>\r\n<p>%civiliter1M_age%,<br />\r\n<br />\r\nNous vous signalons que la fiche produit&nbsp;<strong> %retr_coderetp%</strong> (%retp_des%, code produit fournisseur <strong>%retd_codepdtm%</strong> ) a &eacute;t&eacute; trait&eacute;e par le fournisseur.<br />\r\n<br />\r\nBonne fin de journ&eacute;e.  <br />\r\n<br />\r\nLe centre de gestion</p>', 0),
(168, '2007-10-01', 'Administrateur', '2007-10-01', 'Administrateur', 'RETR_CRE_XXX_CDG', '', 'TRAITEMENT RETOUR  : Email envoyé vers le CDG suite à demande saisie par une agence', '<p>Bonjour,<br />\r\n<br />\r\nNous vous signalons que le produit retourn&eacute;&nbsp;<strong> %retr_coderetp%</strong> a &eacute;t&eacute; trait&eacute; par le fournisseur.<br />\r\n<br />\r\nBonne fin de journ&eacute;e.</p>', 0),
(169, '2008-01-01', 'Administrateur', '2008-01-01', 'Administrateur', 'COL_CRE_XXX_CDG', '', 'CONTRAT LOC : Email envoyé vers le CDG suite à contrat saisi par l''administrateur', '<p>Bonjour,<br />\r\n<br />\r\nNous vous signalons la saisie d''un nouveau contrat (N&deg; <strong>%coloc_code%</strong>).  <br />\r\n<br />\r\nBonne fin de journ&eacute;e.</p>', 0),
(170, '2008-01-04', 'Administrateur', '2008-01-04', 'Administrateur', 'COL_CRE_XXX_AGE', '', 'CONTRAT LOC : Email envoyé vers l''agence suite à un nouveau contrat', '<p>%logo_cge%<br />\r\n%cge_adr1%<br />\r\n%cge_adr2%<br />\r\n%cp_cge% %ville_cge%<br />\r\nTel : %cge_telf%<br />\r\nFax : %cge_fax%</p>\r\n<blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote>\r\n<p><strong>%age_nom%</strong><br />\r\n%age_adr1%<br />\r\n%age_adr2%<br />\r\n%cp_age% %ville_age%<br />\r\nTel : %age_telf%<br />\r\nFax : %age_fax%</p>\r\n</blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>\r\n<p>&nbsp;&nbsp;</p>\r\n<p><strong>A l''attention de %age_resp_civilite% %age_resp_prenom% %age_resp_nom%</strong></p>\r\n<p>%civiliter1M_age%,<br />\r\n<br />\r\nNous vous signalons la saisie d''un nouveau contrat de location (N&deg; <strong>%coloc_code%</strong>, client %cli_code%).<br />\r\n<br />\r\nBonne fin de journ&eacute;e.</p>\r\n<p>Le centre de gestion.</p>', 0),
(171, '2008-01-04', 'Administrateur', '2008-01-04', 'Administrateur', 'COL_CRE_XXX_CLI', '', 'CONTRAT LOC : Email envoyé vers un client suite à création', '<p>%logo_cge%<br />\r\n<strong>%cge_adr1%<br />\r\n%cge_adr2%<br />\r\n%cp_cge% %ville_cge%<br />\r\nTel : %cge_telf%<br />\r\nFax : %cge_fax%</strong></p>\r\n<p>&nbsp;</p>\r\n<blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><strong>%cli_ste%</strong><br />\r\n<strong> %cli_civilite% %cli_prenom% %cli_nom%</strong><br />\r\n<strong> %cli_adr1%</strong><br />\r\n<strong> %cli_adr2%</strong><br />\r\n<strong> %cp_cli% %ville_cli% </strong><br />\r\n<strong> Tel : %cli_telf%</strong><br />\r\n<strong> Fax : %cli_fax%</strong></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>\r\n<p><br />\r\n%civilite1M_cli%,  <br />\r\n<br />\r\nC''est avec plaisir que nous vous annon&ccedil;ons la mise en place de votre contrat de location (N&deg; <strong>%coloc_code%</strong>).  <br />\r\n<br />\r\nMerci de le t&eacute;l&eacute;charger, d''en contr&ocirc;ler l''exactitude (si ce n''&eacute;tait pas le cas, merci de nous le signaler), puis de l''imprimer, depuis votre espace client, sur notre site <a href="http://%cge_web%">%cge_web%</a> (menu &quot;Espace priv&eacute;&quot;) .<br />\r\n<br />\r\nEnsuite, merci de nous le retourner, en deux exemplaires originaux, paraph&eacute;s, tamponn&eacute;s, et sign&eacute;s, &agrave; l''adresse suivante :</p>\r\n<blockquote><strong>%cge_nom%</strong><strong><br />\r\nService Contrats Locations Clients</strong> <br />\r\n%cge_adr1% <br />\r\n%cge_adr2% <br />\r\n%cp_cge% %ville_cge% .</blockquote>\r\n<p><br />\r\nNous vous souhaitons une excellente fin de journ&eacute;e et vous prions d''agr&eacute;er, %civilite1M_cli%,&nbsp; l''expression de nos sentiments les plus d&eacute;vou&eacute;s.<br />\r\n<br />\r\nLe centre de gestion</p>', 0),
(172, '2008-01-04', 'Administrateur', '2008-01-04', 'Administrateur', 'COL_MOD_XXX_AGE', '', 'CONTRAT LOC : Email envoyé vers l''agence suite à modification', '<p>%logo_cge%<br />\r\n%cge_adr1%<br />\r\n%cge_adr2%<br />\r\n%cp_cge% %ville_cge%<br />\r\nTel : %cge_telf%<br />\r\nFax : %cge_fax%</p>\r\n<blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote>\r\n<p><strong>%age_nom%</strong><br />\r\n%age_adr1%<br />\r\n%age_adr2%<br />\r\n%cp_age% %ville_age%<br />\r\nTel : %age_telf%<br />\r\nFax : %age_fax%</p>\r\n</blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>\r\n<p>&nbsp;&nbsp;</p>\r\n<p><strong>A l''attention de %age_resp_civilite% %age_resp_prenom% %age_resp_nom%</strong></p>\r\n<p>%civiliter1M_age%,<br />\r\n<br />\r\nNous vous signalons la mise &agrave; jour du contrat de location N&deg; <strong>%coloc_code%</strong> (client %cli_code%).<br />\r\n<br />\r\nBonne fin de journ&eacute;e.</p>\r\n<p>Le centre de gestion</p>', 0),
(173, '2008-01-04', 'Administrateur', '2008-01-04', 'Administrateur', 'COL_MOD_XXX_CDG', '', 'CONTRAT LOC : Email envoyé vers le CDG suite à modification', '<p>Bonjour,<br />\r\n<br />\r\nNous vous signalons la mise &agrave; jour du contrat N&deg; <strong>%coloc_code%</strong>.<br />\r\n<br />\r\nBonne fin de journ&eacute;e.</p>', 0),
(174, '2008-01-04', 'Administrateur', '2008-01-04', 'Administrateur', 'COL_MOD_XXX_CLI', '', 'CONTRAT LOC : Email envoyé vers un client suite à MAJ', '<p>%logo_cge%<br />\r\n<strong>%cge_adr1%<br />\r\n%cge_adr2%<br />\r\n%cp_cge% %ville_cge%<br />\r\nTel : %cge_telf%<br />\r\nFax : %cge_fax%</strong></p>\r\n<blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><strong>%cli_ste%</strong><br />\r\n<strong> %cli_civilite% %cli_prenom% %cli_nom%</strong><br />\r\n<strong> %cli_adr1%</strong><br />\r\n<strong> %cli_adr2%</strong><br />\r\n<strong> %cp_cli% %ville_cli% </strong><br />\r\n<strong> Tel : %cli_telf%</strong><br />\r\n<strong> Fax : %cli_fax%</strong></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>\r\n<p><br />\r\n%civilite1M_cli%,  <br />\r\n<br />\r\nC''est avec plaisir que nous vous annon&ccedil;ons la modification de votre contrat de location (N&deg; <strong>%coloc_code%</strong>).<br />\r\n<br />\r\nVous pouvez le suivre en temps r&eacute;el sur notre site :  <a href="http://%cge_web%">%cge_web%</a>  .<br />\r\n<br />\r\nNous vous souhaitons une excellente fin de journ&eacute;e et vous prions d''agr&eacute;er, %civilite1M_cli%,&nbsp; l''expression de nos sentiments les plus d&eacute;vou&eacute;s.<br />\r\n<br />\r\nLe centre de gestion</p>', 0),
(175, '2008-01-04', 'Administrateur', '2008-01-04', 'Administrateur', 'CGV_LOC', 'CONDITIONS GENERALES DE LOCATION %cge_nom%', 'Texte master des conditions générales de vente globales location', '<p>Les soussign&eacute;es :</p>\r\n<blockquote><strong>%age_nom%</strong><br />\r\n%age_adr1%   <br />\r\n%age_adr2%   <br />\r\n%cp_age% %ville_age%<br />\r\n%age_rcs%</blockquote>\r\n<p>appel&eacute;e le &quot;PRESTATAIRE&quot;, d''une part, et</p>\r\n<blockquote><strong>%cli_ste%</strong><br />\r\n%cli_adr1%<br />\r\n%cli_adr2%<br />\r\n%cp_cli% %ville_cli%<br />\r\n%cli_rcs%</blockquote>\r\n<p>appel&eacute;e le &quot;LOCATAIRE&quot;, d''autre part,  ont convenus de ce qui suit :</p><br /><br />\r\n<font size="4"><u><strong>Article I : Objet du contrat</strong></u></font><br />\r\n  <font size="3">1.1. Le pr&eacute;sent contrat a pour objet de d&eacute;finir l''ensemble des conditions qui s''appliqueront &agrave; toute prestation de location ou de pr&ecirc;t dont le client est susceptible de commander l''ex&eacute;cution au prestataire pendant la dur&eacute;e d&eacute;finie au pr&eacute;sent contrat. <br />\r\n  1.2. Le pr&eacute;sent contrat a pour objet la location ou le pr&ecirc;t de mat&eacute;riels ou de logiciels, dont la liste est donn&eacute;es sur la premi&egrave;re page dudit contrat.</font><br />\r\n  <font size="4"><u><strong>Article II : Conditions de location</strong></u></font><br />\r\n  <font size="3">2.1 Le locataire est tenu de pr&eacute;senter au loueur une carte d''identit&eacute; ou un passeport en cours de validit&eacute;.<br />\r\n  2.2 La location, qui est personnelle et non transmissible, est conclue pour une dur&eacute;e d&eacute;termin&eacute;e qui sera pr&eacute;cis&eacute;e sur le contrat.<br />\r\n  2.3 Le locataire est responsable envers le loueur de l''ex&eacute;cution int&eacute;grale des pr&eacute;sentes conditions.<br />\r\n  2.4 D&egrave;s la remise du mat&eacute;riel ou du logiciel, le locataire en deviennent enti&egrave;rement responsables selon les termes fix&eacute;s &agrave; l''article 1384 du Code Civil.<br />\r\n  2.5 Le loueur se r&eacute;serve le droit de mettre fin imm&eacute;diatement et de plein droit &agrave; la location sans &ecirc;tre tenu a justification ni indemnit&eacute; dans l''hypoth&egrave;se o&ugrave; le locataire n''aurait pas respect&eacute; l''une des obligations essentielles du contrat de location, notamment les conditions d''utilisation du mat&eacute;riel ou du logiciel,&nbsp; le paiement des loyers, et les conditions de restitution.</font><br />\r\n  <font size="4"><u><strong>Article III : Utilisation du mat&eacute;riel/logiciel</strong></u></font><br />\r\n  <font size="3">Le locataire s''engage :</font>\r\n<ol>\r\n    <li><font size="3">A ne laisser utiliser le mat&eacute;riel que par les utilisateurs autoris&eacute;s que dans le respect des lois en vigueur et dans des conditions d''utilisation l&eacute;gale</font></li>\r\n    <li><font size="3">A ne pas utiliser le mat&eacute;riel ou le logiciel &agrave; titre on&eacute;reux, dans le respect des limites d''utilisation dudit mat&eacute;riel ou logiciel2.</font></li>\r\n    <li><font size="3">A ne pas l''utiliser &agrave; des fins illicites ou immorales ou non pr&eacute;vues par le constructeur et n''y apporter aucune modification.</font></li>\r\n    <li><font size="3">A utiliser le mat&eacute;riel/logiciel lou&eacute; conform&eacute;ment aux r&egrave;glements de douane, au Code P&eacute;nal, et plus g&eacute;n&eacute;ralement conform&eacute;ment aux dispositions l&eacute;gales et r&eacute;glementaires.</font></li>\r\n    <li><font size="3">A utiliser et entretenir le mat&eacute;riel/logiciel en bon p&egrave;re de famille.</font></li>\r\n    <li><font size="3">Le locataire s''engage &agrave; ne pas utiliser le mat&eacute;riel/logiciel sur un autre lieu et sur un autre ordinateur que celui initialement pr&eacute;vu sauf l''accord express et &eacute;crit du prestataire</font></li>\r\n</ol>\r\n<p><font size="4"><u><strong>Article IV : Etat du mat&eacute;riel/logiciel</strong></u></font><br />\r\n    <font size="3">Le mat&eacute;riel/logiciel est livr&eacute; en bon &eacute;tat apparent de marche, sous r&eacute;serve des &eacute;ventuels vices cach&eacute;s et de carrosserie, avec accessoires.<br />\r\n    En signant le contrat, le locataire agr&eacute;e le mat&eacute;riel/logiciel dans l''&eacute;tat o&ugrave; il se trouve et s''oblige &agrave; le restituer dans le m&ecirc;me &eacute;tat de marche et de carrosserie, avec les accessoires en bon &eacute;tat.<br />\r\n    Le locataire s''interdit de r&eacute;clamer des dommages et int&eacute;r&ecirc;ts pour interruption de service, incident ou accident attribu&eacute; &agrave; l''&eacute;tat du mat&eacute;riel/logiciel.<br />\r\n    </font>      <strong><font size="4"><u>Article V : Entretien - R&eacute;parations</u></font></strong><br />\r\n    <font size="3"><strong>5.1. Entretien</strong></font></p>\r\n<blockquote><font size="3">Au moment o&ugrave; le locataire prend possession du mat&eacute;riel/logiciel, il recevra explication d''entretien, d&eacute;taillant les conditions d''entretien et d''utilisation du mat&eacute;riel/logiciel.<br />\r\nEn cas de location prolong&eacute;e au-del&agrave; des limites normales d''entretien et de r&eacute;vision, le locataire doit en avertir le prestataire et faire v&eacute;rifier le fonctionnement du mat&eacute;riel/logiciel aupr&egrave;s du prestataire.<br />\r\nLe locataire s''engage &agrave; acqu&eacute;rir, et ce, d''une mani&egrave;re exclusive, les pi&egrave;ces d&eacute;tach&eacute;es n&eacute;cessaires aux r&eacute;parations aupr&egrave;s du prestataire afin de conserver au mat&eacute;riel toute son homog&eacute;n&eacute;it&eacute;.</font></blockquote><br />\r\n<font size="3"><strong>5.2. - R&eacute;parations</strong></font>\r\n<blockquote><font size="3">Le locataire s''engage &agrave; ce que les r&eacute;parations n&eacute;cessaires soient r&eacute;alis&eacute;es sans d&eacute;lai.<br />\r\nLes r&eacute;parations, &eacute;changes de pi&egrave;ces ou de consommables r&eacute;sultant de l''usure normale ainsi que les visites d''entretien sont &agrave; la charge du prestataire et seront effectu&eacute;s par ses soins. Les r&eacute;parations, &eacute;changes de pi&egrave;ces ou fournitures r&eacute;sultant d''usure anormale, de la n&eacute;gligence, de cause accidentelle ou ind&eacute;termin&eacute;e, demeurent &agrave; la charge du locataire, &agrave; moins que ce dernier ne rapporte la preuve qu''il n''a pas commis de faute.<br />\r\nDans les cas susvis&eacute;s, le locataire s''engage, &agrave; ses frais (frais d''enl&egrave;vement, de transport, de remorquage...), &agrave; ramener le mat&eacute;riel/logiciel, dans les conditions fix&eacute;es ci-dessus.<br />\r\nLa location continuera &agrave; poursuivre ses effets et toutes les obligations subs&eacute;quentes du locataire demeurant en vigueur d&egrave;s lors que le loueur aura &eacute;t&eacute; en mesure de proc&eacute;der au remplacement du mat&eacute;riel/logiciel immobilis&eacute;.</font></blockquote><br />\r\n<font size="4"><u><strong>Article VI : Tarifs</strong></u></font><br />\r\n<font size="3">Les frais de consommables ou carburant sont &agrave; la charge du locataire.<br />\r\nSi le locataire ne restitue pas le mat&eacute;riel avec au moins le niveau d''origine, %cge_nom% assurera la remise &agrave; niveau du mat&eacute;riel et facturera au client les frais dus &agrave; cette op&eacute;ration.<br />\r\nLa journ&eacute;e de location s''entend d''heure &agrave; heure par p&eacute;riode de 12 ou 24 heures selon le tarif appliqu&eacute;.<br />\r\nLa dur&eacute;e de location factur&eacute;e se calcule par tranche de 12 ou 24 heures non fractionnable avec une tol&eacute;rance de 29 minutes.<br />\r\nAu-del&agrave; de celle-ci, selon le tarif appliqu&eacute;, une p&eacute;nalit&eacute; sera appliqu&eacute;e et factur&eacute;e.<br />\r\nLe locataire doit verser au loueur un loyer provisionnel correspondant &agrave; la dur&eacute;e de la location &eacute;tant pr&eacute;cis&eacute; que la fixation du loyer d&eacute;finitif fera l''objet d''une modification fonction du montant du loyer provisionnel vers&eacute;.</font><br />\r\n<font size="4"><u><strong>Article VII : Obligations du locataire</strong></u></font><br />\r\n<font size="3">7.1. Le client s''engage &agrave; respecter les conditions normales d''utilisation du mat&eacute;riel et &agrave; appliquer strictement toutes les instructions donn&eacute;es par le prestataire.<br />\r\n7.2. Le mat&eacute;riel, les &eacute;quipements et leur installation devront &ecirc;tre conformes aux normes fournies par le prestataire, ainsi que le local, les installations &eacute;lectriques et les supports d''information. <br />\r\n7.3. Le mat&eacute;riel et son param&eacute;trage ne pourront &ecirc;tre modifi&eacute;s, d&eacute;plac&eacute;s, r&eacute;par&eacute;s par des tiers sans l''autorisation pr&eacute;alable &eacute;crite du prestataire.<br />\r\n7.4. Les fournitures utilis&eacute;es avec le mat&eacute;riel (papier, bandes, disquettes...) devront correspondre strictement aux fournitures agr&eacute;&eacute;es par le prestataire et restent &agrave; la charge du locataire.<br />\r\n7.5 Le locataire prendra toutes les dispositions pour que les conditions de s&eacute;curit&eacute; &eacute;dict&eacute;es par la l&eacute;gislation soient respect&eacute;es afin d''&eacute;viter tout accident au personnel se servant de ce mat&eacute;riel. Le locataire pr&eacute;voira au d&eacute;part de l''utilisation un disjoncteur diff&eacute;rentiel avec avertissement sonore et d&eacute;clenchement automatique afin de respecter les dispositions des d&eacute;crets sur la protection des travailleurs contre les courants &eacute;lectriques,<br />\r\n7.6 Le locataire est tenu d''assurer le mat&eacute;riel contre tous les risques &agrave; une compagnie d''assurance et, si le prestataire le d&eacute;sire, de le justifier</font><br />\r\n<font size="3">En cas de non-respect de l''une des dispositions du contrat ou des obligations pr&eacute;cis&eacute;es, le prestataire pourra mettre fin au pr&eacute;sent contrat en respectant un pr&eacute;avis d''un mois.</font><br />\r\n<font size="4"><u><strong>Article VIII : Limitation de responsabilit&eacute;</strong></u></font><br />\r\n<font size="3">8.1. Le prestataire sera d&eacute;gag&eacute; de toute responsabilit&eacute; en cas d''inobservation par le client d''une des clauses du pr&eacute;sent contrat, ou en cas de survenance de l''un des faits pr&eacute;vus dans le chapitre 5.<br />\r\n8.2. Le prestataire ne pourra en aucun cas &ecirc;tre consid&eacute;r&eacute; comme responsable des dommages directs ou indirects r&eacute;sultant de l''utilisation du mat&eacute;riel et des logiciels, y compris en cas de pertes de donn&eacute;es ou d''information. Le client s''engage &agrave; se pr&eacute;munir contre ces risques en effectuant au minimum une sauvegarde quotidienne de l''ensemble des informations.<br />\r\n8.3. Le prestataire ne pourra &ecirc;tre rendu responsable des pannes ou anomalies de fonctionnement du mat&eacute;riel, quelle que puisse &ecirc;tre la dur&eacute;e de la panne ou de l''immobilisation avant la remise en marche normale.<br />\r\n8.4. Enfin, la responsabilit&eacute; du prestataire ne pourra &ecirc;tre recherch&eacute;e en cas de force majeure, ou pour d''autres motifs ind&eacute;pendants de sa volont&eacute; tels que gr&egrave;ves, interruptions du travail, retard des prestataires, sinistres ou accidents, interruptions de communication internet ou t&eacute;l&eacute;phonique, conflits, piratage de r&eacute;seau ou d''informations.<br />\r\n8.5. En toute hypoth&egrave;se, si la responsabilit&eacute; du prestataire est engag&eacute;e, l''indemnisation qui pourrait lui &ecirc;tre r&eacute;clam&eacute;e est limit&eacute;e au montant de la redevance per&ccedil;ue par le prestataire au titre de la p&eacute;riode de douze mois en cours.</font><strong><br />\r\n<font size="4"><u>Article IX : Dur&eacute;e du contrat</u></font></strong><br />\r\n<font size="3">9.1. Le pr&eacute;sent contrat est conclu &agrave; compter du %coloc_datedeb%, jusqu''au %coloc_datefin%.</font><br />\r\n<font size="4"><u><strong>Article X : Prix</strong></u></font><br />\r\n<font size="3">10.1. Le montant HT de la location est telle que pr&eacute;vue dans le bar&ecirc;me appliqu&eacute; pour cette location<br />\r\nEn cas de modification ou d''adjonction de mat&eacute;riel, le prix serait modifi&eacute; en cons&eacute;quence.<br />\r\n10.2. Le prix initialement demand&eacute; pourra &ecirc;tre augment&eacute; d''une caution ou d''une p&eacute;nalit&eacute;.<br />\r\n</font><font size="4"><u><strong>Article XI : Conditions de paiement</strong></u></font><br />\r\n<font size="3">11.1. Le co&ucirc;t de la location est factur&eacute; d''avance &agrave; la remise du mat&eacute;riel<br />\r\n11.2. Les frais suppl&eacute;mentaires et p&eacute;nalit&eacute;s sont factur&eacute;s et r&eacute;glables d&egrave;s qu''ils ont &eacute;t&eacute; expos&eacute;s.<br />\r\n11.3. Les factures sont payables &agrave; r&eacute;ception, net, comptant, sans escompte.<br />\r\n11.4 La caution demand&eacute;e &agrave; la remise du mat&eacute;riel sera rendue uniquement si le mat&eacute;riel/logiciel est en bon &eacute;tat de fonctionnement et si toutes les clauses des chap&icirc;tres&nbsp; 2 &agrave; 9 ont &eacute;t&eacute; respect&eacute;es.</font><br />\r\n<font size="4"><u><strong>Article XII : Attribution de juridiction</strong></u></font><br />\r\n<font size="3">Les pr&eacute;c&eacute;dentes conditions ainsi que les actes qui en seront la cons&eacute;quence sont soumis au droit fran&ccedil;ais. Pour tout litige susceptible de survenir, l''attribution expresse de juridiction est faite aux tribunaux de %age_tcom%.<br />\r\n<br />\r\nFait en autant d''exemplaires que de parties aux pr&eacute;sentes, &agrave; %ville_age% le %coloc_datecrea%<br />\r\n<br />\r\n</font><strong>Pour le prestataire :</strong><br />\r\n<em>Nom, pr&eacute;nom (Lettres capitales), qualit&eacute;, signature, et tampon</em>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<strong>Pour le client :</strong><br />\r\n<em>Nom, pr&eacute;nom (Lettres capitales), qualit&eacute;, signature, et tampon</em>\r\n', 0),
(176, '2008-03-25', 'Administrateur', '2008-03-25', 'Administrateur', 'ST_MDP_XXX_ST', '', 'SOUS-TRAITANT : Email envoyé vers le sous-traitant suite à changement de MDP', '<p>%logo_cge%<br />\r\n%cge_adr1%<br />\r\n%cge_adr2%<br />\r\n%cp_cge% %ville_cge%<br />\r\nTel : %cge_telf%<br />\r\nFax : %cge_fax%</p>\r\n<blockquote><blockquote><blockquote><blockquote><blockquote><blockquote><blockquote>\r\n<p><strong>%st_nom%</strong><br />\r\n%st_adr1%<br />\r\n%st_adr2%<br />\r\n%cp_st% %ville_st%<br />\r\nTel : %st_telf%<br />\r\nFax : %st_fax%</p>\r\n</blockquote></blockquote></blockquote></blockquote></blockquote></blockquote></blockquote>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>A l''attention de %st_resp_civilite% %st_resp_prenom% %st_resp_nom%</strong></p>\r\n<p>%civiliter1M_st%,<br />\r\n<br />\r\nC''est avec plaisir que nous vous confirmons la mise &agrave;  jour de votre compte.  Voici vos codes de connexion et mot de passe :</p>\r\n<blockquote>Code de connexion : <strong>%st_code%</strong><br />\r\nMot de passe          : <strong>%pass%</strong></blockquote>\r\n<p><br />\r\nConservez pr&eacute;cieusement ces informations pour pouvoir vous connecter et suivre vos dossiers techniques sur notre site <a href="http://%cge_web%">%cge_web%</a> (menu &quot;Espace priv&eacute;&quot;).<br />\r\n<br />\r\nBonne fin de journ&eacute;e.  <br />\r\n<br />\r\nLe centre de gestion</p>', 0),
